(3410, 373658486, 'Новая Жемчужина в ожерелье Одессы', '048 237 9521', 554090, 'грн', 14581, 1, 38, 7, 21, 'Новостройки', 'Одесса', ' Суворовский', NULL, '30-я Жемчужина на Сахарова ! Квартиры различных площадей от 38 до 98 кв.м. Есть квартиры с видом на море. Закрытая охраняемая территории, автономное отопление, бесшумные высокоскоростные лифты Otis. Очень перспективный район. Рядом супермаркет, кафе, боулинг. Хорошая транспортная развязка.Сдача дома 3-й квартал 2018 г. Возможно покупка в рассрочку с первоначальным взносом от 4%. ОФОРМЛЕНИЕ    0%. Цена от 555 у.е. за кв.м.\r\nКомпанія: Александр-N', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/novaya-zhemchuzhina-v-ozherele-odessy-IDphPDM.html', 'OLX', '["https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/418267418_1_644x461_novaya-zhemchuzhina-v-ozherele-odessy-odessa.jpg"]', '2016-12-20 06:04:32'),
(3411, 364610998, '3-комнатная "чешка" с ремонтом', '0487999695|0975075252|', 1042530, 'грн', 16548, 3, 63, 3, 3, 'Вторичный рынок', 'Одесса', ' Суворовский', NULL, '41486\r\nПродажа 3-комнатной квартиры в городе Одесса на\r\nДнепропетровской дороге. 3 этаж 9-этажного дома. «Чешка». Общая площадь\r\nквартиры 63 кв.м., жилая – 40 кв.м., кухня – 10 кв.м. Квартира с ремонтом.\r\nМеталлопластиковое остекление. Балкон из кухни раскрыт аркой. Паркет. Санузел\r\nсовременно облицован. Новая сантехника, бойлер.\r\n Хорошая транспортная\r\nразвязка. Рядом супермаркет, садик, школа.\r\nКомпанія: Премьер', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/3-komnatnaya-cheshka-s-remontom-IDoFRYy.html', 'OLX', '["https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/405836514_1_644x461_3-komnatnaya-cheshka-s-remontom-odesa.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/405836514_2_644x461_3-komnatnaya-cheshka-s-remontom-fotograf.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/405836514_3_644x461_3-komnatnaya-cheshka-s-remontom-vtorinniy-rinok.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/405836514_4_644x461_3-komnatnaya-cheshka-s-remontom-neruhomst.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/405836514_5_644x461_3-komnatnaya-cheshka-s-remontom-odeska-oblast.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/405836514_6_644x461_3-komnatnaya-cheshka-s-remontom-.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/405836514_7_644x461_3-komnatnaya-cheshka-s-remontom-.jpg"]', '2016-12-20 06:04:35'),
