(3415, 364501552, 'Продается отличная 1 комнатная квартира в Педагогическом переулке', '0487700207|0487700709|', 1024148, 'грн', 24979, 1, 41, 9, 24, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, ' Продается шикарная 1 комнатная квартира в престижном\r\nрайоне города Одессы, а именно – Аркадии! пл. 41/18/12, этаж 9/24.  Удачное сочетание цены и качества! Удобная\r\nпланировка. Европейское качество строительства. МПО, полная автономия\r\nкомплекса, счетчики. Прекрасный вид на город и море!  Звоните!\r\n \r\nКомпанія: Премьер', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodaetsya-otlichnaya-1-komnatnaya-kvartira-v-pedagogicheskom-pereulke-IDoFpwi.html', 'OLX', '["https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/405678628_1_644x461_prodaetsya-otlichnaya-1-komnatnaya-kvartira-v-pedagogicheskom-pereulke-odessa_rev009.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/405678628_2_644x461_prodaetsya-otlichnaya-1-komnatnaya-kvartira-v-pedagogicheskom-pereulke-fotografii_rev009.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/405678628_3_644x461_prodaetsya-otlichnaya-1-komnatnaya-kvartira-v-pedagogicheskom-pereulke-vtorichnyy-rynok_rev009.jpg"]', '2016-12-20 06:04:47'),
(3416, 364609568, 'Трехкомнатная квартира со своим палисадником', '', 1181709, 'грн', 16881, 3, 70, 1, 10, 'Вторичный рынок', 'Одесса', ' Киевский', NULL, 'Глушко/Бювет,трехкомнатная квартира 70м,жилая 44 м, спецпроект, на высоком первом этаже,чистая,теплая, со своим ухоженным палисадничком.\r\nРядом бювет, Киевский и Южный рынки, две школы,садики,до моря 15 минут пешком.\r\nКомпанія: Доминанта. Новострои без комиссии!', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/trehkomnatnaya-kvartira-so-svoim-palisadnikom-IDoFRBu.html', 'OLX', '["https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/405834532_1_644x461_trehkomnatnaya-kvartira-so-svoim-palisadnikom-odessa.jpg"]', '2016-12-20 06:04:49'),
(3417, 356046606, 'Шикарная квартира в Белом Парусе.Просторная с хорошим видом!', '0992526454|0687984087|0487961002|', 6853912, 'грн', 31584, 4, 217, 9, 20, 'Новостройки', 'Одесса', ' Приморский', NULL, 'Самая лучшая цена в Жилом Комплексе Белый парус. Свободная планировка позволяет спланировать 4 просторные комнаты и большую кухню-гостинную. Или разделить на две небольшие квартиры, в зависимости от Ваших потребностей. Эта квартира отлично подойдет, как для жизни, так и под прибыльный бизнес (аренда, мини отель). На этаже всего две квартиры, что сейчас довольно редко встречается. Комплекс комфортный и тихий. К морю 5 мин. Рядом все необходимое для жизни! Квартира в состоянии "от строителей", с балконов отличный вид на море, очень светлая! \r\nЗвоните! Возможен небольшой торг.\r\nКомпанія: Новостройки в Одессе', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/shikarnaya-kvartira-v-belom-paruse-prostornaya-s-horoshim-vidom-IDo5WZc.html', 'OLX', '["https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/408898754_1_644x461_shikarnaya-kvartira-v-belom-paruseprostornaya-s-horoshim-vidom-odessa.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/408898754_2_644x461_shikarnaya-kvartira-v-belom-paruseprostornaya-s-horoshim-vidom-fotografii.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/408898754_3_644x461_shikarnaya-kvartira-v-belom-paruseprostornaya-s-horoshim-vidom-novostroyki.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/408898754_4_644x461_shikarnaya-kvartira-v-belom-paruseprostornaya-s-horoshim-vidom-nedvizhimost.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/408898754_5_644x461_shikarnaya-kvartira-v-belom-paruseprostornaya-s-horoshim-vidom-odesskaya-oblast.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/408898754_6_644x461_shikarnaya-kvartira-v-belom-paruseprostornaya-s-horoshim-vidom-.jpg"]', '2016-12-20 06:04:52'),
