(3420, 369206860, '3-х комнатная рядом с парком Шевченко! Id94124', '+380487002532', 2363418, 'грн', 33287, 3, 71, 3, 4, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, 'Id94124 Квартира в очень хорошем состоянии. Ремонт в классическом стиле делали для себя. Новая крыша, все укрепили. Две просторные спальни с одной выход на балкон, гостиная и кухня соединены. Встроенная кухня и сантехника. Барная стойка. Столярка натуральное дерево. Подвесные потолки с подсветкой. Санузел совмещён. Современная облицовка и сантехника, угловая ванная .Двухконтурный котёл. Бак запаса воды. Кондиционеры. Высота потолков 3.20 метра. Металлопластиковые окна, бронированная дверь, медная проводка. Квартира очень светлая и просторная. Хорошие соседи. В парадной мраморная лестница очень чистая, на коде. Двор закрывается. Хорошая транспортная развязка.\r\nКомпанія: Альянс Первый Банк Недвижимости', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/3-h-komnatnaya-ryadom-s-parkom-shevchenko-id94124-IDoZ9zm.html', 'OLX', '["https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/412092076_1_644x461_3-h-komnatnaya-ryadom-s-parkom-shevchenko-id94124-odesa_rev010.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/412092076_2_644x461_3-h-komnatnaya-ryadom-s-parkom-shevchenko-id94124-fotograf_rev010.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/412092076_3_644x461_3-h-komnatnaya-ryadom-s-parkom-shevchenko-id94124-vtorinniy-rinok_rev010.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/412092076_4_644x461_3-h-komnatnaya-ryadom-s-parkom-shevchenko-id94124-neruhomst_rev010.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/412092076_5_644x461_3-h-komnatnaya-ryadom-s-parkom-shevchenko-id94124-odeska-oblast_rev010.jpg"]', '2016-12-20 06:05:02'),
