(3427, 369210294, 'Достойная 3к.квартира!', '0487090308|0487090506|0487011148|', 2888622, 'грн', 32095, 3, 90, 9, 10, 'Вторичный рынок', 'Одесса', ' Киевский', NULL, 'Современный капитальный ремонт. Две лоджии, из кухни раскрыта аркой. Санузел раздельный. Французские натяжные потолки, импортная облицовка. Столярка дерево. Остается встроенная мебель и бытовая техника. Красивая, уютная квартира находится в ухоженном обжитом микр-не.благоустроенная придомовая территория с зоной отдыха,детской площадкой,спортзал . школа, развлекающий комплексе (р-н Вузовский) А самое главное близко до моря.Звоните. ID 5739\r\nКомпанія: Премьер', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/dostoynaya-3k-kvartira-IDoZasK.html', 'OLX', '["https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_1_644x461_dostoynaya-3kkvartira-odessa_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_2_644x461_dostoynaya-3kkvartira-fotografii_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_3_644x461_dostoynaya-3kkvartira-vtorichnyy-rynok_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_4_644x461_dostoynaya-3kkvartira-nedvizhimost_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_5_644x461_dostoynaya-3kkvartira-odesskaya-oblast_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_6_644x461_dostoynaya-3kkvartira-_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_7_644x461_dostoynaya-3kkvartira-_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_8_644x461_dostoynaya-3kkvartira-_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_9_644x461_dostoynaya-3kkvartira-_rev012.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/412096726_10_644x461_dostoynaya-3kkvartira-_rev012.