(3430, 373658850, '1-к. квартира в ЖК "Солярис"', '048 237 9521', 498944, 'грн', 16094, 1, 31, 5, 10, 'Новостройки', 'Одесса', ' Суворовский', NULL, 'Продам 1-но комнатную квартиру в строящемся доме на Бочарова/Сахарова. Квартира расположена на 5 этаже 10 этажного дома. Дом построен из газобетона - утеплён. Отопление автономное, в каждой квартире будет установлен тепловой счётчик с помощью которого Вы сможете сами регулировать температуру в своей квартире (устанавливать температурный режим). Устанавливается бесшумные лифты OTIS, во дворе детская площадка. Сдача дома  - октябрь 2017 г. Оформление 0 % !!! Возможна покупка в рассрочку. Цена 19 000 у.е. \r\nКомпанія: Александр-N', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/1-k-kvartira-v-zhk-solyaris-IDphPJE.html', 'OLX', '["https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/418267886_1_644x461_1-k-kvartira-v-zhk-solyaris-odessa.jpg","https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/418267886_2_644x461_1-k-kvartira-v-zhk-solyaris-fotografii.jpg"]', '2016-12-20 06:05:31'),
(3431, 363883444, 'Продам 3 х комнатную квартиру в Южноукраинске', '+380683176752', 711523, 'грн', 10164, 3, 70, 7, 9, 'Вторичный рынок', 'Одесса', ' Киевский', NULL, 'Продается 3 х комнатная квартира в городе Южноукраинск , на 7 этаже 9 этажного дома по адресу проспект Соборности 7 напротив   школы № 1 и храма , рядом рынок, автовокзал ,магазины , в доме банк Райфайзенн ,  с частичным ремонтом ( окна и балкон фирмы Rehau ). Установленны счетчики на воду , интернет, стоимость отопления 5 гривен за метр квадратный.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-3-h-komnatnuyu-kvartiru-v-yuzhnoukrainske-IDoCOHO.html', 'OLX', '[]', '2016-12-20 06:05:35'),
(3432, 363905978, 'ЖК «Апельсин». 1 комн. Среднефонтанская ул. Своя реальная квартира!', '+380662960089', 1024148, 'грн', 24384, 1, 42, 13, 24, 'Новостройки', 'Одесса', ' Приморский', NULL, 'ЖК «Апельсин». 1 комн. Среднефонтанская ул. 13/24, 41,4/20,4/11,7. 1 секция. Удобная планировка. Квартира находится за углом дома, ограждающим ее от дороги. Вид на центр города. Лоджия из кухни с панорамным остеклением. При желании, можно увеличить кухню до 17,2 м.кв., совместив ее с лоджией. Санузел совмещен. Потолки 3м. Скоростные автономные лифты ОТИС. Подземный паркинг. Состояние от строителей. Европейский уровень строительства от СК «Будова». Закрытая охраняемая благоустроенная придомовая территория. Удобная транспортная развязка. Рядом парк, школа, детские сады, кинотеатр, большой супермаркет и торговый центр. 39 000 $ с оформлением.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/zhk-apelsin-1-komn-srednefontanskaya-ul-svoya-realnaya-kvartira-IDoCUzg.html', 'OLX', '["https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/404888892_1_644x461_zhk-apelsin-1-komn-srednefontanskaya-ul-svoya-realnaya-kvartira-odessa.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/404888892_2_644x461_zhk-apelsin-1-komn-srednefontanskaya-ul-svoya-realnaya-kvartira-fotografii.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/404888892_3_644x461_zhk-apelsin-1-komn-srednefontanskaya-ul-svoya-realnaya-kvartira-novostroyki.jpg","https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/404888892_4_644x461_zhk-apelsin-1-komn-srednefontanskaya-ul-svoya-realnaya-kvartira-nedvizhimost.jpg"]', '2016-12-20 06:05:38'),
