(3435, 356081860, 'Продам 2 комн.в Одессе на Екатерининской.', '', 1142319, 'грн', 21967, 2, 52, 9, 9, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, 'Срочно Продам 2-комнатную квартиру "Чешка" в центре исторической части города. \r\nКвартира в жилом состоянии, поменяна сантехника (трубы), \r\nсан.узел раздельный, ванная комната выложена плиткой, в кухне металлопластиковое окно, пол линолеум,рабочая стенка плитка, \r\nкомнаты раздельные, в комнатах пол паркет, стены обои, просторный коридор, лоджия по всей длине квартиры застеклена, закрытый двор, домофон, лифт.  (возможность расширения, в подарок дополнительно от 50м.кв.-до200м.кв.  полезной площади, можно под хостел и т.д.\r\nИз окон квартиры открывается шикарный вид на море и город. \r\nРядом всё - это: привоз, железнодорожный вокзал, море, парк, \r\nшкола, детский сад, магазины (какие хочешь), развлекательные современные заведения, театры, церковь, и т. д. шикарная транспортная развязка, как для людей с авто так и без, до Дерибасовской рукой подать.\r\nЭксклюзивный представитель собственника Юрий.', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-2-komn-v-odesse-na-ekaterininskoy-IDo659O.html', 'OLX', '["https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/394300090_1_644x461_prodam-2-komnv-odesse-na-ekaterininskoy-odessa.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/394300090_2_644x461_prodam-2-komnv-odesse-na-ekaterininskoy-fotografii.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/394300090_3_644x461_prodam-2-komnv-odesse-na-ekaterininskoy-vtorichnyy-rynok.jpg"]', '2016-12-20 06:05:47'),
(3436, 373660986, 'СРОЧНАЯ ПРОДАЖА! Квартира с видом на море!', '063 528 3585', 995262, 'грн', 13095, 2, 76, 18, 18, 'Новостройки', 'Одесса', ' Приморский', NULL, 'Новый Дом "Микромегас". \r\nСдача дома к Новому Году :)\r\nадрес: Днепропетровская дорога, 21.\r\nНереально НИЗКАЯ ЦЕНА в связи с срочной продажей.\r\nЦена почти на 7000 долл. ниже чем от строителя!\r\nДвухкомнатная квартира с шикарным видом на море!  Хозяин сделал перепланировку, поэтому комнаты большие, просторные и уютные.\r\nВ этом доме предусмотрены низкие затраты на коммунальные платежи.\r\nВ доме 2 лифта — пассажирский и грузопассажирский. \r\nОбращайтесь по тф\\вайбер  635 - Показать номер -', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/srochnaya-prodazha-kvartira-s-vidom-na-more-IDphQi6.html', 'OLX', '["https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418265944_3_644x461_srochnaya-prodazha-kvartira-s-vidom-na-more-novostroyki.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418265944_1_644x461_srochnaya-prodazha-kvartira-s-vidom-na-more-odessa.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418265944_2_644x461_srochnaya-prodazha-kvartira-s-vidom-na-more-fotografii.jpg"]', '2016-12-20 06:05:50'),
(3437, 373661920, '2 комнатная на Черемушках, Щорса - рассрочка!', '063 924 00 60', 685170, 'грн', 9135, 2, 75, 4, 10, 'Новостройки', 'Одесса', ' Малиновский', NULL, 'Рассрочка на выгодных условиях  до 3 лет!\r\nПервый взнос указан 50%\r\nКвартира в СДАННОМ доме из красного кирпича. Двусторонняя, две лоджии. Заведены коммуникации, установлены приборы учета, под чистовую отделку.\r\nСвоя котельная, подстанция, запас воды на 3 дня. В парадной консьержка, двор под охраной, парковка.', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/2-komnatnaya-na-cheremushkah-schorsa-rassrochka-IDphQxa.html', 'OLX', '["https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418271646_1_644x461_2-komnatnaya-na-cheremushkah-schorsa-rassrochka-odessa_rev003.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418271646_2_644x461_2-komnatnaya-na-cheremushkah-schorsa-rassrochka-fotografii_rev003.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418271646_3_644x461_2-komnatnaya-na-cheremushkah-schorsa-rassrochka-novostroyki_rev003.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418271646_4_644x461_2-komnatnaya-na-cheremushkah-schorsa-rassrochka-nedvizhimost_rev003.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418271646_5_644x461_2-komnatnaya-na-cheremushkah-schorsa-rassrochka-odesskaya-oblast_rev003.jpg"]', '2016-12-20 06:05:53'),
(3438, 373662688, 'Продам тех этаж на Высоцкого Цена 8 тыс $', '380 991 743536', 210822, 'грн', 8784, 1, 24, 11, 10, 'Новостройки', 'Одесса', ' Суворовский', NULL, 'Продам тех этаж на Высоцкого конечная маршрутки 145 \r\nОбщая площадь 24 кв.м потолки 2.20,окно 20 на 20.,свободная планировка. \r\nСостояние от строителя,можно перевести в жилой фонд. \r\nДом 5 лет как сдан. \r\nЦена 8 тыс $', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-teh-etazh-na-vysotskogo-tsena-8-tys-IDphQJy.html', 'OLX', '[]', '2016-12-20 06:05:55'),
(3439, 349859782, 'Жемчужина на Французском Бульваре. С ремонтом в шикарном доме.', '0992526454|0687984087|0487961002|', 2100816, 'грн', 38904, 1, 54, 3, 22, 'Новостройки', 'Одесса', ' Приморский', NULL, 'Инвестор. Дорогой, качественный ремонт: художественная роспись на стенах, натяжные потолки, дорогие люстры, двери в черном стекле, импортная сантехника, мебель на заказ, встроенный холодильный шкаф, оборудована гардеробная комната 5кв.м., шкафы  купе зеркальные. Панорамное остекление в кухне. В доме паркинг и охрана. Звоните!\r\nКомпанія: Новостройки в Одессе', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-IDnFYwI.html', 'OLX', '["https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/408900470_1_644x461_zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-odesa.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/408900470_2_644x461_zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-fotograf.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/408900470_3_644x461_zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-novobudovi.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/408900470_4_644x461_zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-neruhomst.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/408900470_5_644x461_zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-odeska-oblast.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/408900470_6_644x461_zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/408900470_7_644x461_zhemchuzhina-na-frantsuzskom-bulvare-s-remontom-v-shikarnom-dome-.jpg"]', '2016-12-20 06:05:58'),
(3440, 350814228, '2х комнатная квартира в ЖК Белый парус. Ремонт дизайнерский!', '0992526454|0687984087|0487961002|', 3807729, 'грн', 40081, 2, 95, 13, 20, 'Новостройки', 'Одесса', ' Приморский', NULL, 'ЖК Белый парус, Одесса, 8 ст. Большого Фонтана, Литературная\r\nКрасивая квартира с качественным современным дизайнерским ремонтом в престижном ЖК Белый парус! Две спальни и просторная кухня-студия.Гостевой сан.узел и ванная комната в хозяйской спальне. Есть лоджия, боковой вид на море. Панорамное остекление, большой подземный паркинг, охрана и видео-наблюдение. В доме фитнес клуб и бассейн.  Спуск к морю, престижный район. Дом великолепной архитектуры, для ценителей красоты и комфорта! Звоните!\r\nКомпанія: Новостройки в Одессе', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/2h-komnatnaya-kvartira-v-zhk-belyy-parus-remont-dizaynerskiy-IDnJYO0.html', 'OLX', '["https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/408902606_1_644x461_2h-komnatnaya-kvartira-v-zhk-belyy-parus-remont-dizaynerskiy-odesa_rev044.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/408902606_2_644x461_2h-komnatnaya-kvartira-v-zhk-belyy-parus-remont-dizaynerskiy-fotograf_rev044.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/408902606_3_644x461_2h-komnatnaya-kvartira-v-zhk-belyy-parus-remont-dizaynerskiy-novobudovi_rev044.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/408902606_4_644x461_2h-komnatnaya-kvartira-v-zhk-belyy-parus-remont-dizaynerskiy-neruhomst_rev044.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/408902606_5_644x461_2h-komnatnaya-kvartira-v-zhk-belyy-parus-remont-dizaynerskiy-odeska-oblast_rev044.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/408902606_6_644x461_2h-komnatnaya-kvartira-v-zhk-belyy-parus-remont-dizaynerskiy-_rev044.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/408902606_7_644x461_2h-komnatnaya-kvarti