(3456, 373664896, 'T Продам однокомнатную квартиру в жилом комплексе Радужный.', '0487430151|0504345151|0630735151|0985015151|', 516013, 'грн', 13946, 1, 37, 3, 15, 'Новостройки', 'Одесса', ' Киевский', NULL, 'АКЦИЯ! Цены снижены на 20%.\r\n Отдел продаж ЖК «Радужный» расположен по\r\nадресу: массив Радужный, дом № 17.\r\nПродам однокомнатную квартиру в жилом комплексе Радужный.Жилой комплекс Радужный, ООО «Руником Стройинвест» официальный отдел продаж квартир. Площадь квартиры 36,60/17/11 м.кв., лоджия, этаж 3/15. Тип строения: монолитно-каркасный с заполнением газобетоном и утеплением наружных стен. Состояние: пол: чистовая стяжка, стены: шпатлевка, окна МП, дверь входная бронированная, радиаторы, счетчики на воду и электричество. Автономное отопление, 2 бесшумных лифта. Новый дом, благоустроенная территория, парковка, детская площадка, садик, школа, супермаркет, остановки общественного транспорта. Возможна поэтапная оплата, рассрочка.\r\nКомпанія: ЖК Радужный Одесса', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/t-prodam-odnokomnatnuyu-kvartiru-v-zhilom-komplekse-raduzhnyy-IDphRja.html', 'OLX', '["https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/418276168_1_644x461_t-prodam-odnokomnatnuyu-kvartiru-v-zhilom-komplekse-raduzhnyy-odessa.jpg"]', '2016-12-20 06:06:50'),
(3457, 373665294, 'Продам! 15-я Жемчужина!Евро!', '098 846 4881', 1391791, 'грн', 34794, 1, 40, 14, 18, 'Новостройки', 'Одесса', ' Киевский', NULL, 'Авторский проект в стиле лофт \r\nПанорамное остекление \r\nСантехника - Германия и Италия \r\nНемецкий ламинат,Испанская плитка \r\nКухня - итальянский шпон дсп \r\nВытяжка - Италия \r\nДвери - массив карпатского дуба \r\nВсе дерево,использовавшееся в  отделке,привезено из экологически чистых районов Закарпатья\r\nВ квартире есть большая гардеробная \r\nДом расположен в микрорайоне с развитой инфраструктурой: универсамы,фитнесс клуб ,в ближайшее время будет детский сад . \r\nБоковой вид на море,которое в пяти минутах езды.\r\nФронтальный вид  меняться не будет- под окнами высажена аллея из акаций.\r\nКомпанія: Альфа Недвижимость', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-15-ya-zhemchuzhina-evro-IDphRpA.html', 'OLX', '["https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_1_644x461_prodam-15-ya-zhemchuzhinaevro-odessa.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_2_644x461_prodam-15-ya-zhemchuzhinaevro-fotografii.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_3_644x461_prodam-15-ya-zhemchuzhinaevro-novostroyki.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_4_644x461_prodam-15-ya-zhemchuzhinaevro-nedvizhimost.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_5_644x461_prodam-15-ya-zhemchuzhinaevro-odesskaya-oblast.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_6_644x461_prodam-15-ya-zhemchuzhinaevro-.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_7_644x461_prodam-15-ya-zhemchuzhinaevro-.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/418276664_8_644x461_prodam-15-ya-zhemchuzhinaevro-.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/41