(3458, 373666184, 'V Юг Одессы, продается двухкомнатная квартира в новом ЖК Радужный 2', '0487430151|0504345151|0630735151|0985015151|', 774676, 'грн', 13130, 2, 59, 6, 15, 'Новостройки', 'Одесса', ' Киевский', NULL, 'Юг Одессы, продается двухкомнатная квартира в новом ЖК Радужный 2ЖК "Радужный 2" ОДЕССА, продажа двухкомнатных квартир от застройщика.\r\n Отдел продаж ЖК «Радужный» расположен по\r\nадресу: массив Радужный, дом № 17.\r\nПостроено: 37 домов.В продаже: 6 новых домов.Продам двухкомнатную квартиру в новом доме в Одессе в жилом комплексе "Радужный 2", пр. Маршала Жукова/ул. ЛевитанаДом: 3Секция: ВПлощадь общая м.кв.: 59 (есть выбор планировок)Площадь жилая м.кв.: 27,66Площадь кухни м.кв.: 11,02Этаж: 6 (есть выбор этажей)Этажность: 15Состояние: от строителей (пол стяжка, стены шпатлеваны, дверь бронированная, окна МП, радиаторы, счетчики на воду и электричество)Автономия: котельная, солнечные батареи, газовый генератор на работу лифта, подкачку воды, аварийное освещениеПожарная сигнализацияДвор: закрытая территорияПаркингИнфраструктура: РазвитаяРассрочка: Возможно\r\nКомпанія: ЖК Радужный Одесса', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/v-yug-odessy-prodaetsya-dvuhkomnatnaya-kvartira-v-novom-zhk-raduzhnyy-2-IDphRDV.html', 'OLX', '["https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/418278006_1_644x461_v-yug-odessy-prodaetsya-dvuhkomnatnaya-kvartira-v-novom-zhk-raduzhnyy-2-odessa.jpg"]', '2016-12-20 06:06:55'),
