(3479, 364624256, 'Дом СДАН!2-ком .квартира у самого моря', '066 595 4066', 2100816, 'грн', 28778, 2, 73, 4, 11, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, 'Дом расположен на 10-й станции Б.Фонтана, окружен парковой зоной находится в элитном квартале коттеджной застройки.\r\nКомплекс с единой инфраструктурой, отвечающий всем требованиям высокого статуса владельцев. Специально выбранное место, атмосфера благополучия и комфорта. Дом, в котором хочется жить, где за окнами шумит прибой у стен древнего города. Идеальный дом, в котором абсолютно все от места до фундамента и инфраструктуры подчинено единому замыслу.\r\nВ доме предусмотрены квартиры на любой вкус, каждый найдет то, что соответствует его вкусу. Квартиры-студии, свободные планировки и традиционные апартаменты. При отделке фасада использованы современные строительные и отделочные материалы. Отопление предусмотрено от индивидуальной газовой котельной. Дом оснащен бесперебойной системой водоснабжения и очистки воды. К вашим услугам современные бесшумные лифты. В доме предусмотрена система жизнеобеспечения, гарантирующая Вашу безопасность, комфортное проживание.\r\nКомпанія: Региональный центр недвижимости Империя Квартир', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/dom-sdan-2-kom-kvartira-u-samogo-morya-IDoFWqo.html', 'OLX', '["https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/405856206_1_644x461_dom-sdan2-kom-kvartira-u-samogo-morya-odessa.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/405856206_2_644x461_dom-sdan2-kom-kvartira-u-samogo-morya-fotografii.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/405856206_3_644x461_dom-sdan2-kom-kvartira-u-samogo-morya-vtorichnyy-rynok.jpg"]', '2016-12-20 06:07:59'),
