(3486, 330251912, 'Продается 1-комн. с Альковом в Кирпичном доме на Черемушках.', '095-584-84-85', 682765, 'грн', 17967, 1, 38, 8, 9, 'Вторичный рынок', 'Одесса', ' Малиновский', NULL, 'Продается хорошая 1-комнатная квартира в кирпичном доме Черемушках. Чистое жилое состояние. Бронированная дверь. На полу в комнате и кухне линолеум, в санузле - плитка. Санузел совмещен, современная облицовка, трубы поменяны, приборы учета, бойлер. Второй дом от дороги, зеленый уютный двор.', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodaetsya-1-komn-s-alkovom-v-kirpichnom-dome-na-cheremushkah-IDmlHBK.html', 'OLX', '["https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/362420606_1_644x461_prodaetsya-1-komn-s-alkovom-v-kirpichnom-dome-na-cheremushkah-odessa_rev014.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/362420606_3_644x461_prodaetsya-1-komn-s-alkovom-v-kirpichnom-dome-na-cheremushkah-vtorichnyy-rynok_rev014.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/362420606_4_644x461_prodaetsya-1-komn-s-alkovom-v-kirpichnom-dome-na-cheremushkah-nedvizhimost_rev014.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/362420606_6_644x461_prodaetsya-1-komn-s-alkovom-v-kirpichnom-dome-na-cheremushkah-_rev014.jpg"]', '2016-12-20 06:08:20'),
(3487, 373672236, 'V Продам двухкомнатную квартиру в ЖК Радужный, Таирово, ул. Левитана.', '0487430151|0504345151|0630735151|0985015151|', 804875, 'грн', 12576, 2, 64, 4, 15, 'Новостройки', 'Одесса', ' Киевский', NULL, 'АКЦИЯ! Цены снижены на 20%.\r\n Отдел продаж ЖК «Радужный» расположен по\r\nадресу: массив Радужный, дом № 17.\r\nПродам двухкомнатную квартиру в ЖК Радужный, Таирово, ул. Левитана.ЖК Радужный, Таирово, ул. Левитана. ООО «Руником Стройинвест» официальный отдел продаж. Площадь квартиры 63,81/34/9 м.кв., 2 лоджии, этаж 4/15 (есть выбор этажей). Тип строения: монолитно-каркасный с заполнением газобетоном и утеплением наружных стен. Состояние: пол: чистовая стяжка, стены: шпатлевка, окна МП, дверь входная бронированная, радиаторы, счетчики на воду и электричество. Автономное отопление, 2 бесшумных лифта. Новый дом, благоустроенная территория, парковка, детская площадка, садик, школа, супермаркет, остановки общественного транспорта. Возможна поэтапная оплата, рассрочка.\r\nКомпанія: ЖК Радужный Одесса', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/v-prodam-dvuhkomnatnuyu-kvartiru-v-zhk-raduzhnyy-tairovo-ul-levitana-IDphTdy.html', 'OLX', '["https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/418286614_1_644x461_v-prodam-dvuhkomnatnuyu-kvartiru-v-zhk-raduzhnyy-tairovo-ul-levitana-odessa.jpg"]', '2016-12-20 06:08:23'),
(3488, 373672216, '1к кв-ра в хорошем р-не, тёплый кирпичный дом 3/9эт, хорошее состояние', '068-935-63-67', 472684, 'грн', 19695, 1, 24, 3, 9, 'Вторичный рынок', 'Одесса', ' Суворовский', NULL, 'Лучшее предложение в этой ценовой категории на сегодняшний день!\r\nПродаётся «Гостинка» в тёплом кирпичном доме, расположенном на Добровольского / Затонского.\r\nКвартира находится на 3 этаже девятиэтажного дома. Окна выходят во двор.\r\nБольшой балкон. Общая площадь 24 кв.м., кухня 5,5 кв.м.\r\nКвартира в хорошем состоянии.\r\nУстановлены металлопластиковые окна, электробойлер, бронированная дверь.\r\nНа полу ламинат и плитка.\r\nВнутренняя столярка и трубы поменяны, новые радиаторы.\r\nВ стоимость входит встроенная кухня и бытовая техника.\r\nРядом д/садик и 2 школы, магазины, супермаркет «Таврия», парк, остановки общественного транспорта.\r\nСрочно! НЕ УПУСТИТЕ СВОЙ ШАНС!\r\nЗвоните и мы покажем в удобное для Вас время.\r\nАН «Партнер Эстейт»', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/1k-kv-ra-v-horoshem-r-ne-teplyy-kirpichnyy-dom-3-9et-horoshee-sostoyanie-IDphTde.html', 'OLX', '["https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/418286000_1_644x461_1k-kv-ra-v-horoshem-r-ne-teplyy-kirpichnyy-dom-3-9et-horoshee-sostoyanie-odessa.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/418286000_2_644x461_1k-kv-ra-v-horoshem-r-ne-teplyy-kirpichnyy-dom-3-9et-horoshee-sostoyanie-fotografii.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/418286000_3_644x461_1k-kv-ra-v-horoshem-r-ne-teplyy-kirpichnyy-dom-3-9et-horoshee-sostoyanie-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/418286000_4_644x461_1k-kv-ra-v-horoshem-r-ne-teplyy-kirpichnyy-dom-3-9et-horoshee-sostoyanie-nedvizhimost.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/418286000_5_644x461_1k-kv-ra-v-horoshem-r-ne-teplyy-kirpichnyy-dom-3-9et-horoshee-sostoyanie-odesskaya-oblast