(3489, 373672730, '1 ком квартира с ремонтом возле Сити Центра', '097 934 5690', 632465, 'грн', 19165, 1, 33, 5, 5, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, 'Однокомнатная квартира в хорошем жилом состоянии, после ремонта. Ровные потолки. Встроенная кухня с бытовой техникой. Металлопластиковые окна, балкон застеклен .Кухня 7 м.кв. Газовая колонка. В доме установлен счетчик на тепло. Чистая парадная на коде. Зеленый двор с детской площадкой и зоной отдыха. Рядом  Сити Центр, супермаркет Сельпо, Таврия, школа, детский сад, развитая инфрастуктура. Отличная транспортная развязка   (2- 18914 -12) Наталья', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/1-kom-kvartira-s-remontom-vozle-siti-tsentra-IDphTlv.html', 'OLX', '["https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418282486_4_644x461_1-kom-kvartira-s-remontom-vozle-siti-tsentra-nedvizhimost_rev002.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418282486_2_644x461_1-kom-kvartira-s-remontom-vozle-siti-tsentra-fotografii_rev002.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418282486_5_644x461_1-kom-kvartira-s-remontom-vozle-siti-tsentra-odesskaya-oblast_rev002.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418282486_6_644x461_1-kom-kvartira-s-remontom-vozle-siti-tsentra-_rev002.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418282486_7_644x461_1-kom-kvartira-s-remontom-vozle-siti-tsentra-_rev002.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418282486_3_644x461_1-kom-kvartira-s-remontom-vozle-siti-tsentra-vtorichnyy-rynok_rev002.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/418282486_8_644x461_1-kom-kvartira-s-remontom-vozle-siti-tsentra-_rev002.jpg"]', '2016-12-20 06:08:29'),
