(3492, 373674284, 'T Продам трехкомнатную квартиру с двумя лоджиями, ЖК Радужный Одесса', '0487430151|0504345151|0630735151|0985015151|', 967688, 'грн', 12567, 3, 77, 7, 15, 'Новостройки', 'Одесса', ' Киевский', NULL, 'АКЦИЯ! Цены снижены на 20%.\r\n Отдел продаж ЖК «Радужный» расположен по\r\nадресу: массив Радужный, дом № 17.\r\nТрехкомнатная квартира с тремя лоджиями, ЖК Радужный.Супер проект. Стороны света Восток, Юг, Запад. Продается квартира в жилом массиве Радужный. При покупке квартиры возможна рассрочка. Раздельные комнаты, 2 лоджии, с/у раздельный (есть выбор этажей). Состояние квартиры - стены чистовая шпатлевка, пол стяжка счетчики на свет и воду, импортные радиаторы, окна и двери на лоджию МП, входная бронированная дверь. Во дворе благоустроенная территория, детские площадки, фонтаны. Парковка для автомобилей. Развитая инфраструктура. Общественный транспорт.\r\nКомпанія: ЖК Радужный Одесса', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/t-prodam-trehkomnatnuyu-kvartiru-s-dvumya-lodzhiyami-zhk-raduzhnyy-odessa-IDphTKA.html', 'OLX', '["https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/418289416_1_644x461_t-prodam-trehkomnatnuyu-kvartiru-s-dvumya-lodzhiyami-zhk-raduzhnyy-odessa-odessa.jpg"]', '2016-12-20 06:08:37'),
