(3499, 371536038, '1 Жемчужина: продам потрясающую квартиру в новом доме у моря в Аркадии', '0975777737|', 3282525, 'грн', 50500, 1, 65, 5, 22, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, 'Гагаринское плато / ЖК\r\n«Первая Жемчужина», 5/22 эт., продам квартиру в новом доме от ведущей\r\nстроительной компании «Kadorr Group», 65/28/18 кв.м, светлая солнечная спальня\r\nи кухня-столовая, великолепный качественный современный ремонт и изысканный дизайн\r\nинтерьера, красивые подсветки и натяжные потолки, застекленная лоджия со\r\nвходами из кухни и спальни, просторный сан. узел с ванной, холл, гардеробная, полностью\r\nукомплектована мебелью и бытовой техникой, встроенная кухня, стиральная и\r\nпосудомоечная машины, духовой шкаф, СВЧ-печь, два кондиционера, плазменные телевизоры,\r\nинтернет, абсолютно вся комплектация входит в стоимость, ухоженная и охраняемая\r\nпридомовая территория, потрясающая полностью готовая современная квартира  в одном из лучших домов Одессы в пяти минутах\r\nходьбы от моря и пляжа в престижной Аркадии!\r\nКомпанія: Александр-N', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/1-zhemchuzhina-prodam-potryasayuschuyu-kvartiru-v-novom-dome-u-morya-v-arkadii-IDp8WuK.html', 'OLX', '["https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415246298_1_644x461_1-zhemchuzhina-prodam-potryasayuschuyu-kvartiru-v-novom-dome-u-morya-v-arkadii-odessa.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415246298_2_644x461_1-zhemchuzhina-prodam-potryasayuschuyu-kvartiru-v-novom-dome-u-morya-v-arkadii-fotografii.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415246298_3_644x461_1-zhemchuzhina-prodam-potryasayuschuyu-kvartiru-v-novom-dome-u-morya-v-arkadii-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415246298_4_644x461_1-zhemchuzhina-prodam-potryasayuschuyu-kvartiru-v-novom-dome-u-morya-v-arkadii-nedvizhimost.jpg","https:\\/\\/olxua-rin