(3501, 371533374, '2 ком квартира (75 кв.м.) на Парковой. Дом готов.', '0961075233|0639774375|0502539324|0487831623|', 971627, 'грн', 12955, 2, 75, 9, 11, 'Новостройки', 'Одесса', ' Малиновский', NULL, '2 ком квартира  в новом, жилом, кирпичном  доме в хорошей  части города, \r\nДве застекленные лоджии.  Светлые комнаты, просторная прихожая, санузел раздельный.  Газовая плита.\r\nПолная автономия, развитая инфраструктура.  Крышное газовое отопление, охраняемая территория.  Состояние от строителей.  Улучшенная планировка. Высокое качество строительства. Современное жилье для Вас и Ваших детей.  Покупайте и будьте счастливы в новом доме.\r\nДом готов к сдаче, люди делают ремонты.\r\nКомпанія: ул.Успенская', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/2-kom-kvartira-75-kv-m-na-parkovoy-dom-gotov-IDp8UNM.html', 'OLX', '["https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415242438_1_644x461_2-kom-kvartira-75-kvm-na-parkovoy-dom-gotov-odessa.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415242438_2_644x461_2-kom-kvartira-75-kvm-na-parkovoy-dom-gotov-fotografii.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415242438_3_644x461_2-kom-kvartira-75-kvm-na-parkovoy-dom-gotov-novostroyki.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415242438_4_644x461_2-kom-kvartira-75-kvm-na-parkovoy-dom-gotov-nedvizhimost.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415242438_5_644x461_2-kom-kvartira-75-kvm-na-parkovoy-dom-gotov-odesskaya-oblast.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/415242438_6_644x461_2-kom-kvartira-75-kvm-na-parkovoy-dom-gotov-.jpg"]', '2016-12-20 06:09:04'),
(3502, 333641460, 'СРОЧНО! Квартира недорого в сельской местности. Заходи и живи!', '0996389594|0633443247|', 263527, 'грн', 4054, 2, 65, 2, 2, 'Вторичный рынок', 'Малаевцы', ' Окнянский район', NULL, 'ПРОДАМ ИЛИ ОБМЕНЯЮ НА КОМНАТУ В КОММУНЕ. Квартира со всеми удобствами, мебелью, металлопластиковыми окнами в сельской местности на втором этаже четырёхквартирного дома. Есть гараж, подвал, хоз.строения.\r\nДетали\r\nОтдельная квартира, дом в эксплуатации - украинский кирпич, в квартире 2 комнаты, высота потолков 2.6 метра. Квартира двухсторонняя. Планировка комнат раздельная. Кухонная плита газовая. Холодная вода - водопровод, горячая вода - электрический бойлер. Отопление автономное. Раздельный санузел. Сантехника в нормальном состоянии. Проведены металлопластиковые трубы, новые. Покрытие полов - дерево, линолеум. Есть лоджия, застеклена. Состояние стен - ремонт не требуется. Окна металлопластиковые, новые. Межкомнатные двери типовые, в нормальном состоянии. Тамбур отдельный. Дом построен в 1989 году. Своя канализация. Общее состояние квартиры - хорошее состояние. Возможна прописка. Рядом есть школа, детсад, речка/озеро, лес. Квартира приватизированная. Документы на квартиру: свидетельство о праве собственности на жилье (при приватизации). Торг уместен. Продажа от хозяина.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/srochno-kvartira-nedorogo-v-selskoy-mestnosti-zahodi-i-zhivi-IDmzWnS.html', 'OLX', '["https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/366475500_1_644x461_srochno-kvartira-nedorogo-v-selskoy-mestnosti-zahodi-i-zhivi-kotovsk.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/366475500_2_644x461_srochno-kvartira-nedorogo-v-selskoy-mestnosti-zahodi-i-zhivi-fotografii.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/366475500_3_644x461_srochno-kvartira-nedorogo-v-selskoy-mestnosti-zahodi-i-zhivi-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/366475500_4_644x461_srochno-kvartira-nedorogo-v-selskoy-mestnosti-zahodi-i-zhivi-nedvizhimost.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/366475500_5_644x461_srochno-kvartira-nedorogo-v-selskoy-mestnosti-zahodi-i-zhivi-odesskaya-oblast.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/366475500_6_644x461_srochno-kvartira-nedorogo-v-selskoy-mestnosti-zahodi-i-zhivi-.jpg"]', '2016-12-20 06:09:07'),
(3503, 373676844, 'V Продам однокомнатную квартиру в ЖК Радужный, Таирово, ул. Левитана.', '0487430151|0504345151|0630735151|0985015151|', 514700, 'грн', 13544, 1, 38, 3, 15, 'Новостройки', 'Одесса', ' Киевский', NULL, 'АКЦИЯ! Цены снижены на 20%.\r\n Отдел продаж ЖК «Радужный» расположен по\r\nадресу: массив Радужный, дом № 17.\r\nЖК Радужный, Таирово, ул. Левитана. ООО «Руником Стройинвест» официальный отдел продаж. Площадь квартиры от 34 м.кв., этаж 3/15 (есть выбор этажей) . Тип строения: монолитно-каркасное с заполнением газобетоном и утеплением наружных стен. Состояние: пол: чистовая стяжка, стены: шпатлевка, окна МП, дверь входная бронированная, радиаторы, счетчики на воду и электричество. Автономное отопление, 2 бесшумных лифта. Парковка. Возможна поэтапная оплата, рассрочка.\r\nКомпанія: ЖК Радужный Одесса', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/v-prodam-odnokomnatnuyu-kvartiru-v-zhk-raduzhnyy-tairovo-ul-levitana-IDphUpS.html', 'OLX', '["https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/418292920_1_644x461_v-prodam-odnokomnatnuyu-kvartiru-v-zhk-raduzhnyy-tairovo-ul-levitana-odessa.jpg"]', '2016-12-20 06:09:10'),
(3504, 338779398, 'Продам 3-х комн на ул.Княжеская', '0636470007', 1317635, 'грн', 21960, 3, 60, 4, 5, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, 'Продам свою квартирую ул.Княжеская/Новосельского.\r\nПосле ремонта, новая мебель и кухня, комнаты смежно-раздельные (14+14+6 м2), кухня 8 м2, т/в раздельные, бойлер ГВ, отопление ТЭЦ, балкон на фасад, все удобства, интернет, домофон.\r\nУютная квартира в комфортном, тихом районе. Рядом Новый базар и магазин "Таврия". Район Мед.института.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-3-h-komn-na-ul-knyazheskaya-IDmWtZQ.html', 'OLX', '["https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_1_644x461_prodam-3-h-komn-na-ulknyazheskaya-odessa.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_2_644x461_prodam-3-h-komn-na-ulknyazheskaya-fotografii.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_3_644x461_prodam-3-h-komn-na-ulknyazheskaya-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_4_644x461_prodam-3-h-komn-na-ulknyazheskaya-nedvizhimost.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_5_644x461_prodam-3-h-komn-na-ulknyazheskaya-odesskaya-oblast.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_6_644x461_prodam-3-h-komn-na-ulknyazheskaya-.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_7_644x461_prodam-3-h-komn-na-ulknyazheskaya-.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_8_644x461_prodam-3-h-komn-na-ulknyazheskaya-.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_9_644x461_prodam-3-h-komn-na-ulknyazheskaya-.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/372699590_10_644x461_prodam-3-h-komn-na-ulknyazheskaya-.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/