(3506, 364635606, '62 кв.м. Два балкона. Новый дом. Срочно! Черемушки/Таирова', '0487880423|0683103639|', 1181315, 'грн', 19053, 2, 62, 11, 23, 'Вторичный рынок', 'Одесса', ' Малиновский', NULL, 'Отличное предложение! 11/23. Западная. От строителей. Общая площадь - 62 кв.м. Односторонняя.  Раздельные комнаты: 20,70 кв.м. и 15,20 кв.м. Кухня - 11,70 кв.м. Прихожая - 8,50 кв.м. Санузел - 4,40 кв.м. Балкон из каждой комнаты по 2,80 кв.м. \r\nЧетыре лифта. Генераторы бесперебойного питания. Система "Умный дом". Автономное отопление - крышная котельная. Парадная с ремонтом. \r\nДом в стадии строительства. \r\nПредусматривается облагороженная придомовая территория, ландшафтное озеленение, детские игровые и спортивные площадки. \r\nПаркинг.\r\nУдобное расположение дома - пересечение двух районов - Черемушки и Таирова, транспортное сообщение в любую часть города!\r\nЗвоните! \r\nВарианты.\r\nКомпанія: Региональный центр недвижимости Империя Квартир', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/62-kv-m-dva-balkona-novyy-dom-srochno-cheremushki-tairova-IDoFYns.html', 'OLX', '["https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/405873324_1_644x461_62-kvm-dva-balkona-novyy-dom-srochno-cheremushki-tairova-odessa.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/405873324_2_644x461_62-kvm-dva-balkona-novyy-dom-srochno-cheremushki-tairova-fotografii.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/405873324_3_644x461_62-kvm-dva-balkona-novyy-dom-srochno-cheremushki-tairova-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/405873324_4_644x461_62-kvm-dva-balkona-novyy-dom-srochno-cheremushki-tairova-nedvizhimost.jpg"]', '2016-12-20 06:09:19'),
(3507, 369234286, 'Продам 2 комнатную КВАРТИРУ с ремонтом в  ЦЕНТРЕ.', '0482399380|0684696476|0487032828|', 1299880, 'грн', 27657, 2, 47, 1, 1, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, ' Продам 2 комнатную  квартиру в кирпичном доме в Центре горда. Общая площадь 47 кв.м. Капитальный ремонт. Автономное отопление. Есть балкон.В продаже с мебелью и бытовой техникой. Рядом магазины, парк Шевченко и море.  Удобная транспортная развязка\r\nЦена 49,5 тыс. у.е. (код 823782)\r\nКомпанія: Лидер АН', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-2-komnatnuyu-kvartiru-s-remontom-v-tsentre-IDoZgHI.html', 'OLX', '["https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/412130110_1_644x461_prodam-2-komnatnuyu-kvartiru-s-remontom-v-tsentre-odesa_rev012.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/412130110_2_644x461_prodam-2-komnatnuyu-kvartiru-s-remontom-v-tsentre-fotograf_rev012.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/412130110_3_644x461_prodam-2-komnatnuyu-kvartiru-s-remontom-v-tsentre-vtorinniy-rinok_rev012.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/412130110_4_644x461_prodam-2-komnatnuyu-kvartiru-s-remontom-v-tsentre-neruhomst_rev012.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/412130110_5_644x461_prodam-2-komnatnuyu-kvartiru-s-remontom-v-tsentre-odeska-oblast_rev012.jpg","https:\\/\\/olxua-ring11.akamaized.net\\/images_slandocomua\\/412130110_6_644x461_prodam-2-komnatnuyu-kvartiru-s-remontom-v-tsentre-_rev012.jpg"]', '2016-12-20 06:09:22'),
(3508, 371539280, '3 ком квартира (96 кв. м.) на Грушевского. Дом готов', '0961075233|0639774375|0502539324|0487831623|', 1293315, 'грн', 13063, 3, 99, 6, 11, 'Новостройки', 'Одесса', ' Малиновский', NULL, '3 ком, двухсторонняя квартира в десятиэтажном, новом, кирпичном доме, который \r\nрасположен в  микрорайоне с развитой\r\nинфраструктурой:: школы, детские сады, супермаркеты и рынки, медицинские\r\nучреждения, спортивные учреждения, а также торгово-развлекательный центры все это рядом.\r\nПросторные комнаты, раздельный санузел, застекленные лоджии. \r\n Дом построен по современным технологиям: автономная крышная\r\nкотельная, бесшумные скоростные лифты, МПО, цифровая телефонная связь,\r\nинтернет, кабельное телевиденье. Интересная планировка квартиры.\r\nДом готов, люди делают ремонты.\r\nКомпанія: ул.Успенская', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/3-kom-kvartira-96-kv-m-na-grushevskogo-dom-gotov-IDp8Vl2.html', 'OLX', '["https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/415251076_1_644x461_3-kom-kvartira-96-kv-m-na-grushevskogo-dom-gotov-odesa_rev006.jpg","https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/415251076_2_644x461_3-kom-kvartira-96-kv-m-na-grushevskogo-dom-gotov-fotograf_rev006.jpg","https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/415251076_3_644x461_3-kom-kvartira-96-kv-m-na-grushevskogo-dom-gotov-novobudovi_rev006.jpg","https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/415251076_4_644x461_3-kom-kvartira-96-kv-m-na-grushevskogo-dom-gotov-neruhomst_rev006.jpg","https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/415251076_5_644x461_3-kom-kvartira-96-kv-m-na-grushevskogo-dom-gotov-odeska-oblast_rev006.jpg","https:\\/\\/olxua-ring09.akamaized.net\\/images_slandocomua\\/415251076_6_644x461_3-kom-kvartira-96-kv-m-na-grushevskogo-dom-gotov-_rev006.jpg"]', '2016-12-20 06:09:26'),
(3509, 316550762, 'Продам 2 комн кв ОТДЕЛ ПРОДАЖ ОТ ЗАСТРОЙЩИКА ,Академгородок Совиньон', '0487990024', 892847, 'грн', 16846, 2, 53, 3, 5, 'Новостройки', 'Одесса', ' Киевский', NULL, 'Малоэтажный жилой комплекс в элитном районе города Одессы вблизи моря.Он расположен в Совиньоне, Черноморка.Индивидуальное газовое отопление в каждой квартире, закрытая охраняемая территория, игровые детские площадки,рядом супермаркет.Данный комплекс представлен строительной компанией ОК "Гранит"Однокомнатные от 36 до 38 м2: Двухкомнатные от 52 до 66 м2: \r\nПанорамное остекление\r\nВремя работы с 9 00 до 16 00 на  объекте , отдел продаж  секция 2 этаж1 (  в остальное время звонить по телефону ( 048) 702 30 43 \r\nСекции  1   2   4   7   8 \r\nДОМ СДАН В ЭКСПЛУАТАЦИЮ', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-2-komn-kv-otdel-prodazh-ot-zastroyschika-akademgorodok-sovinon-IDlqdjs.html', 'OLX', '["https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/346065142_1_644x461_prodam-2-komn-kv-otdel-prodazh-ot-zastroyschika-akademgorodok-sovinon-odessa.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/346065142_2_644x461_prodam-2-komn-kv-otdel-prodazh-ot-zastroyschika-akademgorodok-sovinon-fotografii.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/346065142_3_644x461_prodam-2-komn-kv-otdel-prodazh-ot-zastroyschika-akademgorodok-sovinon-novostroyki.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/346065142_4_644x461_prodam-2-komn-kv-otdel-prodazh-ot-zastroyschika-akademgorodok-sovinon-nedvizhimost.jpg"]', '2016-12-20 06:09:29'),
(3510, 363938984, 'Продам 3-х комнатную квартиру ул.Посмитного 7-ая Фонтана', '0637359563|', 1706913, 'грн', 25101, 3, 68, 4, 9, 'Вторичный рынок', 'Одесса', ' Приморский', NULL, 'Продам 3-х комнатную квартиру  ул.Посмитного 7 Фонтана  4/9 кирпичного дома общая площадь 68кв.м.жилая 40кв.м.перепланировка кухня студия,две спальни, ремонт, м/п скна,паркет.плитка,с/у облицован,душевая кабина.балкон,лоджия застеклены,встроенная кухня,электробойлер, стиральная машина автомат, кондиционер,двойная  бронированная дверь,тамбур на две квартиры,чистая парадная на кодовом замке,квартира продаётся с мебелью и бытовой техникой.Цена 65000у.е.Торг.', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-3-h-komnatnuyu-kvartiru-ul-posmitnogo-7-aya-fontana-IDoD39C.html', 'OLX', '[]', '2016-12-20 06:09:32'),
(3511, 324336670, 'СРОЧНО! Комната в коммуне.', '0935602177', 341383, 'грн', 4551, 1, 75, 3, 3, 'Вторичный рынок', 'Одесса', ' Суворовский', NULL, 'Продам свою комнату в трехкомнатной квартире.\r\nСталинка.Суворовский р-н. \r\nВ комнате сделан евро ремонт. Площадь комнаты + альков = 16.5 кв м. На полу ламинат. Все сделано со вкусом и очень качественно. Можно сделать как квартиру-студию. Есть интернет и кабельное ТВ. Новая электропроводка. Стоит стиральная машинка. В квартире двухконтурный котёл, парадная после кап. ремонта, установлен домофон, двор закрытого типа на три парадных. 13000 $ торг уместен. Две остальных комнаты так же продаются. Есть вариант выкупить как полноценную квартиру. Общая площадь квартиры 75 кв м. Срочно ! (Хорошему покупателю мебель в подарок)', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/srochno-komnata-v-kommune-IDlVSMC.html', 'OLX', '["https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_1_644x461_srochno-komnata-v-kommune-odessa_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_2_644x461_srochno-komnata-v-kommune-fotografii_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_3_644x461_srochno-komnata-v-kommune-vtorichnyy-rynok_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_4_644x461_srochno-komnata-v-kommune-nedvizhimost_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_5_644x461_srochno-komnata-v-kommune-odesskaya-oblast_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_6_644x461_srochno-komnata-v-kommune-_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_7_644x461_srochno-komnata-v-kommune-_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_slandocomua\\/355204028_8_644x461_srochno-komnata-v-kommune-_rev001.jpg","https:\\/\\/olxua-ring03.akamaized.net\\/images_sl