(3513, 373683448, 'T От строителя ЖК Радужный 2 в Одессе продажа двухкомнатной квартиры.', '0487430151|0504345151|0630735151|0985015151|', 827196, 'грн', 12533, 2, 66, 5, 13, 'Новостройки', 'Одесса', ' Киевский', NULL, 'От строителя ЖК Радужный 2 в Одессе продажа квартирЖК "Радужный 2" ОДЕССА, продажа двухкомнатных квартир от застройщика.\r\n Отдел продаж ЖК «Радужный» расположен по\r\nадресу: массив Радужный, дом № 17.\r\nПостроено: 37 домов.В продаже: 6 новых домов.Продам двухкомнатную квартиру в новом доме в Одессе в жилом комплексе "Радужный 2", пр. Маршала Жукова/ул. ЛевитанаСекция: А, ДПлощадь общая м.кв.: 65,86 (есть выбор планировок)Площадь жилая м.кв.: 35,19Площадь кухни м.кв.: 12,84Этаж: 5 (есть выбор этажей)Этажность: 13Состояние: от строителей (пол стяжка, стены шпатлеваны, дверь бронированная, окна МП, радиаторы, счетчики на воду и электричество)Автономия: котельная, солнечные батареи, газовый генератор на работу лифта, подкачку воды, аварийное освещениеПожарная сигнализацияДвор: закрытая территорияПаркингИнфраструктура: РазвитаяРассрочка: Возможно\r\nКомпанія: ЖК Радужный Одесса', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/t-ot-stroitelya-zhk-raduzhnyy-2-v-odesse-prodazha-dvuhkomnatnoy-kvartiry-IDphV8o.html', 'OLX', '["https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/418302078_1_644x461_t-ot-stroitelya-zhk-raduzhnyy-2-v-odesse-prodazha-dvuhkomnatnoy-kvartiry-odessa.jpg"]', '2016-12-20 06:09:41'),
(3514, 373684446, 'T Экономьте Ваши деньги. Покупайте 3-ком-ную квартиру по выгодной цене', '0487430151|0504345151|0630735151|0985015151|', 972392, 'грн', 12628, 3, 77, 7, 14, 'Новостройки', 'Одесса', ' Киевский', NULL, 'Экономьте Ваши деньги! Покупайте трехкомнатную квартиру по выгодной цене!ЖК "Радужный 2" ОДЕССА, продажа трехкомнатных квартир от застройщика.\r\n Отдел продаж ЖК «Радужный» расположен по\r\nадресу: массив Радужный, дом № 17.\r\nПостроено: 37 домов.В продаже: 6 новых домов.Продам трехкомнатную квартиру в новом доме в Одессе в жилом комплексе "Радужный 2", пр. Маршала Жукова/ул. ЛевитанаСекция: А, ДПлощадь общая м.кв.: 77,26 (есть выбор планировок)Площадь жилая м.кв.: 45,06Площадь кухни м.кв.: 8,33Этаж: 7 (есть выбор этажей)Этажность: 14Состояние: от строителей (пол стяжка, стены шпатлеваны, дверь бронированная, окна МП, радиаторы, счетчики на воду и электричество)Автономия: котельная, солнечные батареи, газовый генератор на работу лифта, подкачку воды, аварийное освещениеПожарная сигнализацияДвор: закрытая территорияПаркингИнфраструктура: РазвитаяРассрочка: Возможно\r\nКомпанія: ЖК Радужный Одесса', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/t-ekonomte-vashi-dengi-pokupayte-3-kom-nuyu-kvartiru-po-vygodnoy-tsene-IDphVou.html', 'OLX', '["https:\\/\\/olxua-ring04.akamaized.net\\/images_slandocomua\\/418303448_1_644x461_t-ekonomte-vashi-dengi-pokupayte-3-kom-nuyu-kvartiru-po-vygodnoy-tsene-odessa_rev001.jpg"]', '2016-12-20 06:09:44'),
(3515, 217378906, 'Срочно\n        Комната в коммунальной квартире', '0958815617', 395291, 'грн', 20804, 1, 19, 1, 2, 'Вторичный рынок', 'Одесса', ' Малиновский', NULL, 'Продается комната в коммунальнальной квартире. Район Застава- 2 (рынок), Комната 19 к.м. Очень чистая, теплая, с новой проводкой. В комнате два металлопластиковых окна,решетки на окнах. Светлая чистая кухня, туалет и душ совмещен (новый современный кафель, новые коммуникации и сантехника), бойлер.  Два соседа (тихие, спокойные люди, чистоплотные).Уютный закрытый двор, чистая парадная. Тараканов и других насекомых нет. Есть место для парковки авто. Рядом рынок, школа.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/komnata-v-kommunalnoy-kvartire-IDeI6bo.html', 'OLX', '["https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/226496266_1_644x461_komnata-v-kommunalnoy-kvartire-odessa.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/226496266_2_644x461_komnata-v-kommunalnoy-kvartire-fotografii.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/226496266_3_644x461_komnata-v-kommunalnoy-kvartire-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/226496266_4_644x461_komnata-v-kommunalnoy-kvartire-nedvizhimost.jpg"]', '2016-12-20 06:09:47'),
(3516, 373685116, 'Квартира в Белгород-Днестровске', '0636412822', 498944, 'грн', 7919, 3, 63, 4, 6, 'Новостройки', 'Белгород-Днестровский', ' Белгород-Днестровский район', NULL, 'Продаётся квартира в новостройке, 2 км до лимана, 15 до моря. Дом на стадии заселения. Все детали по телефону, спрашивать Анатолия. Возможен торг.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/kvartira-v-belgorod-dnestrovske-IDphVzi.html', 'OLX', '["https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418306336_1_644x461_kvartira-v-belgorod-dnestrovske-belgorod-dnestrovskiy.jpg"]', '2016-12-20 06:09:50'),
(3517, 142422855, 'Продам 3-комнатную квартиру в пгт Рауховка, Березовского р-на, Одес.об', '0675568103', 395291, 'грн', 61, 3, 6459, 1, 5, 'Вторичный рынок', 'Рауховка', ' Березовский район', NULL, 'Продам 3-комнатную квартиру, 1/5, общая площадь 64,59 кв.м., жилая площадь 43,43 кв.м.. 2 комнаты по 16,2 кв.м, 3 - 11,03 кв.м., кухня -9,3 кв.м, туалет и ванная раздельные. \r\nКвартира под ремонт с индивидуальным отоплением, свет, вода, газ. \r\nБывший военный городок, есть вся инфраструктура. Хорошая транспортная развязка: электричка, автобусы, горнолыжный курорт "Березовский".\r\nЦена: 15000 у.е (реальному покупателю - реальный торг)', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-3-komnatnuyu-kvartiru-v-pgt-rauhovka-berezovskogo-r-na-odes-ob-ID9DAGP.html', 'OLX', '["https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/140225699_1_644x461_prodam-3-komnatnuyu-kvartiru-v-pgt-rauhovka-berezovskogo-r-na-odesob-berezovka.jpg"]', '2016-12-20 06:09:53'),
(3518, 331800730, 'Своя квартира в новом доме на 13 ст. Фонтана. Свободная планировка.', '0681168921', 1791984, 'грн', 20363, 2, 88, 15, 22, 'Вторичный рынок', 'Одесса', ' Киевский', NULL, 'Продам СВОЮ квартиру в новом доме по ул.Макаренко/Львовская.\r\nОбщая площадь - 87,8 кв.м. \r\nПо плану - гостиная с кухней-студией + 2 спальни.\r\nФактически - свободная планировка.\r\nВозможна перепланировка в 3х-комнатную.\r\nОчень светлая квартира.\r\nЭркер с боковым видом на море. \r\nДом расположен в 10 мин ходьбы от моря.\r\nИз окон - шикарный вид на город!!!\r\nТорг уместен', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/svoya-kvartira-v-novom-dome-na-13-st-fontana-svobodnaya-planirovka-IDmscvG.html', 'OLX', '["https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/364272598_2_644x461_svoya-kvartira-v-novom-dome-na-13-st-fontana-svobodnaya-planirovka-fotografii.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/364272598_1_644x461_svoya-kvartira-v-novom-dome-na-13-st-fontana-svobodnaya-planirovka-odessa.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/364272598_3_644x461_svoya-kvartira-v-novom-dome-na-13-st-fontana-svobodnaya-planirovka-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/364272598_4_644x461_svoya-kvartira-v-novom-dome-na-13-st-fontana-svobodnaya-planirovka-nedvizhimost.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/364272598_5_644x461_svoya-kvartira-v-novom-dome-na-13-st-fontana-svobodnaya-planirovka-odesskaya-oblast.jpg","https:\\/\\/olxua-ring05.akamaized.net\\/images_slandocomua\\/364272598_6_644x461_svoya-kvartira-v-novom-dome-na-13-st-fontana-svobodnaya-planirovka-.jpg"]', '2016-12-20 06:09:56'),
