(3520, 366896416, '2-х комн.квартира Приморский р-он,вид на море,900у.е.,м.кв.(94)', '0674819555', 1706913, 'грн', 22758, 2, 75, 17, 18, 'Новостройки', 'Одесса', ' Приморский', NULL, 'В новом сданном доме,в элитном районе ,рядом с самым красивым парком города продается 2-х комн.кв.Отличная планировка,просторная кухня,большая лоджия.площадь холла позволяет организовать гардеробную .Двор благоустроен и оборудован детской площадкой.Из окон открывается вид на море.\r\nКомпанія: Партнер Эстейт', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/2-h-komn-kvartira-primorskiy-r-on-vid-na-more-900u-e-m-kv-94-IDoPsv8.html', 'OLX', '["https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/408940310_1_644x461_2-h-komnkvartira-primorskiy-r-onvid-na-more900uemkv94-odesa.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/408940310_2_644x461_2-h-komnkvartira-primorskiy-r-onvid-na-more900uemkv94-fotograf.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/408940310_3_644x461_2-h-komnkvartira-primorskiy-r-onvid-na-more900uemkv94-novobudovi.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/408940310_4_644x461_2-h-komnkvartira-primorskiy-r-onvid-na-more900uemkv94-neruhomst.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/408940310_5_644x461_2-h-komnkvartira-primorskiy-r-onvid-na-more900uemkv94-odeska-oblast.jpg"]', '2016-12-20 06:10:02'),
(3521, 248968738, 'Продам 3-комнатную квартиру в Лиманском (Раздельнянский р-н)', '0979357298', 263527, 'грн', 3764, 3, 70, 3, 5, 'Вторичный рынок', 'Лиманское', ' Раздельнянский район', NULL, 'Продам 3-комнатную квартиру  3 этаж пятиэтажного дома в военном городке Лиманское (60 км от Одессы, 10 км от Кучурган) от собственника, квартира расположена в среднем подъезде, сухая,светлая. Окна спальни выходят во двор, остальные окна с красивым видом на лиман. Сделан косметический ремонт, метало-пластиковые окна, бронированная дверь, застекленная лоджия, туалет с ванной раздельные, большая кухня, все комнаты также раздельные. На кухне новая кухонная мебель, новая плита и много другой мебели остается в квартире. Рядом есть магазины, рынок, аптеки и многое другое. Есть тамбур на 2 квартиры, хорошие соседи. \r\nЦена 10000 $, звоните по тел.  668 - Показать номер - ,  979 - Показать номер -  Валентина.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-3-komnatnuyu-kvartiru-v-limanskom-razdelnyanskiy-r-n-IDgQE8O.html', 'OLX', '["https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/264132074_1_644x461_prodam-3-komnatnuyu-kvartiru-v-limanskom-razdelnyanskiy-r-n-razdelnaya.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/264132074_2_644x461_prodam-3-komnatnuyu-kvartiru-v-limanskom-razdelnyanskiy-r-n-fotografii.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/264132074_3_644x461_prodam-3-komnatnuyu-kvartiru-v-limanskom-razdelnyanskiy-r-n-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/264132074_4_644x461_prodam-3-komnatnuyu-kvartiru-v-limanskom-razdelnyanskiy-r-n-nedvizhimost.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/264132074_5_644x461_prodam-3-komnatnuyu-kvartiru-v-limanskom-razdelnyanskiy-r-n-odesskaya-oblast.jpg"]', '2016-12-20 06:10:05'),
(3522, 373692666, 'ПРОДАЕТСЯ 4х. комнатная квартира от собственника', '0681021234', 761546, 'грн', 9287, 4, 82, 9, 9, 'Вторичный рынок', 'Теплодар', ' Одесса', NULL, 'Своя 4х.комнатная квартира с ремонтом,чистая,заходи и живи.Снаружи утеплена.  Бронированная дверь,металопластиковые окна, кабельное, интернет.Проводка менялась полностью по всей квартире на качественную медь.Бойлер на 100 литров воды.Была сделана перепланировка, добавилась еще одна спальня. Перепланировка узаконена. Установлен домофон. В зале есть декоративный камин. Канализация поменяна полностью.Вся квартира застелена качественным ламинатом. Так как квартира на 9 этаже, есть чердак где есть свое отдельное помещение площадью 17 м.кв. с закрывающейся на замок дверью. Можно использовать для любых целей.Есть возможность сделать выход из кладовой своей квартиры в помещение на чердаке.    Общая площадь 82м.кв.   Зал 18м.кв.     Спальня1 -  13м.кв.     Спальня2  -  11м.кв.     Спальня3   -  9м.кв     Кухня 10м.кв.  Туалет и ванная комната разделены.  Окна квартиры выходят на обе стороны дома. С одной стороны застекленный металопластиком балкон, с другой -  лоджа тоже застеклена металопластиком.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodaetsya-4h-komnatnaya-kvartira-ot-sobstvennika-IDphYx4.html', 'OLX', '["https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418310890_1_644x461_prodaetsya-4h-komnatnaya-kvartira-ot-sobstvennika-teplodar_rev001.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418310890_2_644x461_prodaetsya-4h-komnatnaya-kvartira-ot-sobstvennika-fotografii_rev001.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418310890_3_644x461_prodaetsya-4h-komnatnaya-kvartira-ot-sobstvennika-vtorichnyy-rynok_rev001.jpg","https:\\/\\/olxua-ring12.akamaized.net\\/images_slandocomua\\/418310890_5_644x461_prodaetsya-4h-komnatnaya-kvartira-ot-sobstvennika-odesskaya-oblast_rev001.jpg","https:\\/\\/olxua-ring12.a