(3523, 294612342, 'Продам квартиру в Овидиополе.', '380931444750', 790581, 'грн', 0, 2, 0, 2, 3, 'Вторичный рынок', 'Овидиополь', ' Овидиопольский район', NULL, 'Продам свою квартиру в Овидиополе ул.Ленина! Хорошая двухкомнатная квартира в хорошем состоянии. Имеется большая лоджия.Есть вся необходимая мебель ,ванная ,стиральная машинка , санузел! Своё отопление!', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-kvartiru-v-ovidiopole-IDjVa7Y.html', 'OLX', '["https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_1_644x461_prodam-kvartiru-v-ovidiopole-ovidiopol.jpg","https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_2_644x461_prodam-kvartiru-v-ovidiopole-fotografii.jpg","https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_3_644x461_prodam-kvartiru-v-ovidiopole-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_4_644x461_prodam-kvartiru-v-ovidiopole-nedvizhimost.jpg","https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_5_644x461_prodam-kvartiru-v-ovidiopole-odesskaya-oblast.jpg","https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_6_644x461_prodam-kvartiru-v-ovidiopole-.jpg","https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_7_644x461_prodam-kvartiru-v-ovidiopole-.jpg","https:\\/\\/olxua-ring02.akamaized.net\\/images_slandocomua\\/320114726_8_644x461_prodam-kvartiru-v-ovidiopole-.jpg"]', '2016-12-20 06:10:12'),
(3524, 132330653, '3х комнатная квартира в пригороде Одессы (ст. Буялык)', '0679985420', 472684, 'грн', 7878, 3, 60, 3, 5, 'Вторичный рынок', 'Петровка', ' Ивановский район', NULL, '3х комнатная квартира с ремонтом. Сан узел совмещённый, ламинат, индивид. отопление, бойлер застеклённый балкон, южная сторона. Школа и садик рядом. Спросить Елену.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/3h-komnatnaya-kvartira-v-prigorode-odessy-st-buyalyk-ID8Xffn.html', 'OLX', '["https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/129996325_1_644x461_3h-komnatnaya-kvartira-v-prigorode-odessy-st-buyalyk-berezovka.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/129996325_2_644x461_3h-komnatnaya-kvartira-v-prigorode-odessy-st-buyalyk-fotografii.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/129996325_3_644x461_3h-komnatnaya-kvartira-v-prigorode-odessy-st-buyalyk-vtorichnyy-rynok.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/129996325_4_644x461_3h-komnatnaya-kvartira-v-prigorode-odessy-st-buyalyk-nedvizhimost.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/129996325_5_644x461_3h-komnatnaya-kvartira-v-prigorode-odessy-st-buyalyk-odesskaya-oblast.jpg","https:\\/\\/olxua-ring08.akamaized.net\\/images_slandocomua\\/129996325_6_644x461_3h-komnatnaya-kvartira-v-prigorode-odessy-st-buyalyk-.jpg"]', '2016-12-20 06:10:14'),
