(3527, 348412970, '2комн.кварт.с раздельными комнатами ул. Ак.Королева', '0679047086', 1575612, 'грн', 30894, 2, 51, 1, 10, 'Вторичный рынок', 'Одесса', ' Киевский', NULL, 'Продам 2 комн.кварт. ул. Ак.Королева/ул. Левитана.. 1/10. 51/28/7.5.. Кирпичный спецпроэкт. Не угловая. Теплая. Лоджия застеклена. Квартира с качественным  ремонтом( 2011 года). . Комнаты раздельные.. Сигнализация. Видео наблюдение.Домофон. Тамбур на 2 квартиры. Парадная чистая.  Есть кладовка на лестничной площадке. Остается встроенная мебель и бытовая техника.  Дворовая.Торг возможен.\r\nКомпанія: Александр-N', 'Состояние', NULL, 'Бизнес', '********', '********', 'https://www.olx.ua/obyavlenie/2komn-kvart-s-razdelnymi-komnatami-ul-ak-koroleva-IDnzU82.html', 'OLX', '["https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_1_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-odessa_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_2_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-fotografii_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_3_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-vtorichnyy-rynok_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_4_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-nedvizhimost_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_5_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-odesskaya-oblast_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_6_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_7_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_8_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_9_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_10_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_11_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-_rev101.jpg","https:\\/\\/olxua-ring01.akamaized.net\\/images_slandocomua\\/384568202_12_644x461_2komnkvarts-razdelnymi-komnatami-ul-akkoroleva-_rev101.jpg"]', '2016-12-20 06:10:23'),
(3528, 226811900, 'Продам СВОЮ 1-но комнатную квартиру на Вильямса / Королева', '0995525920', 711523, 'грн', 20329, 1, 35, 6, 9, 'Вторичный рынок', 'Одесса', ' Киевский', NULL, 'РИЭЛТОРАМ НЕ БЕСПОКОИТЬ!\r\n Без торга.Нотариальной оформление - пополам.\r\nПродам или обменяю на 3,2-х комнатную квартиру на Таирова,  светлую 1-но комнатную квартиру на Вильямса, угол Королева от хозяина.Второй ряд домов. Большая, просторная кухня и комната, хорошая, свежая косметика. Окна-металлопластик, балкон застекленный (дерево), кондиционер, бойлер. Рядом: рынки "Южный"и "Киевский",супермаркеты, кафе, школы. Детский садик находится в 50-ти метрах от подъезда, есть детская площадка. Хорошая транспортная развязка. 30 минут прогулочным шагом и вы на море (Золотой берег).', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/prodam-svoyu-1-no-komnatnuyu-kvartiru-na-vilyamsa-koroleva-IDflG8s.html', 'OLX', '["https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/237566238_1_644x461_prodam-svoyu-1-no-komnatnuyu-kvartiru-na-vilyamsa-koroleva-odessa_rev002.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/237566238_3_644x461_prodam-svoyu-1-no-komnatnuyu-kvartiru-na-vilyamsa-koroleva-vtorichnyy-rynok_rev002.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/237566238_2_644x461_prodam-svoyu-1-no-komnatnuyu-kvartiru-na-vilyamsa-koroleva-fotografii_rev002.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/237566238_5_644x461_prodam-svoyu-1-no-komnatnuyu-kvartiru-na-vilyamsa-koroleva-odesskaya-oblast_rev002.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/237566238_7_644x461_prodam-svoyu-1-no-komnatnuyu-kvartiru-na-vilyamsa-koroleva-_rev002.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/237566238_9_644x461_prodam-svoyu-1-no-komnatnuyu-kvartiru-na-vilyamsa-koroleva-_rev002.jpg","https:\\/\\/olxua-ring10.akamaized.net\\/images_slandocomua\\/237566238_10_644x461_