(3529, 307258332, 'ЖК 5я Жемчужина + паркинг (возможен обмен)', '', 2626020, 'грн', 32024, 2, 82, 7, 18, 'Вторичный рынок', 'Одесса', ' Киевский', NULL, 'Цена включая паркинг 100000$\r\nПродам свою 2х комнатную квартиру с видом на три стороны (ул.Архитекторскую - Царское село-двор дома), два балкона. Квартира тёплая, стеклопакет пятикамерный (окна зимой не потеют)  вентилируемый фасад включительно по 18й этаж. Так же паркинг на одну машину. Дизайн проэкт 3D. Рассмотрю варианты ОБМЕНА на недвижимость.\r\nКухня 18м\r\nПрихожая 16.8м\r\nТуалет/ванная 7.3м\r\nКомнаты 16.4м / 21.8м\r\nРемонт в квартире не окончен, описание читайте ниже.\r\nКвартира полностью обесшумлена кроме пола, стены в два слоя, материал использовался Rockwooll. \r\nВысота потолков 2.95м.  \r\nСостояния стен под обои.\r\nЭлектричество и сантехника полностью разведены по квартире.\r\nПодрозетники Vimar. \r\nRehau фитинги, трубы сшитый полиэтилен. \r\nВанная фирмы Ravak,\r\nСтул откидной Ravak, под него делался металический каркас который вмонтирован в стену. \r\nВнутри польный конвектор Fancoil с комнатным регулятором температуры.\r\nИнсталляция  унитаза фирмы Geberit с удалением запаха. \r\nВсе канализационные трубы безшумлнная канализация немецкой фирмы Ostendorf\r\nБольшой полотенце сушитель делался на заказ на котором можно сушить пастельное белье. \r\nРегулятор температуры фирмы Danfoss.\r\nДуш фирмы Bugnatese (плита встроенная в стену), режим душа и водопада, Италия.\r\nДушевая система Hansgrohe Axor Stark скрытого монтажа.\r\nРучной душ Hansgrohe Axor Stark  Organic под неё с двумя режимами (боковым и прямым)\r\nТрап немецкой фирмы ACO (большой)\r\nВсе вентиляционные каналы обесшумлены хорошим и качественным материалом фирмы Henkel.\r\nПроведена система дренажа под два кондиционера (кухня, спальня).\r\nРемонт делался для себя, но планы поменялись. \r\nСвою машину Вы сможете увидеть из окна спальни.\r\nПо запросу вышлю больше фото на Viber, WhatsApp. \r\nПРОДАЖА ПО ПЕРЕУСТУПКЕ.', 'Состояние', NULL, 'Частного лица', '********', '********', 'https://www.olx.ua/obyavlenie/zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-IDkNdWy.html', 'OLX', '["https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_1_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-odessa_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_2_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-fotografii_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_3_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-vtorichnyy-rynok_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_4_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-nedvizhimost_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_5_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-odesskaya-oblast_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_6_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_7_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_8_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_9_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_10_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_11_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-_rev072.jpg","https:\\/\\/olxua-ring07.akamaized.net\\/images_slandocomua\\/335112748_12_644x461_zhk-5ya-zhemchuzhina-parking-vozmozhen-obmen-_rev072.jpg"]', '2016-12-20 06:10:29'),
