(3541, 11791795, ' Продаётся уникальная квартира рядом с Оперным', '0938016691', 0, 'грн', 0, 3, 135, 2, 4, 'Вторичный рынок', 'Одесса', 'Приморский', 'Ланжероновская улица', 'Продаётся уникальная квартира рядом с Оперным театром, в доме Навроцкого – одном из главных архитектурных символов г. Одессы. Дом построен в 1891 году, полная реставрация проведена в 2005 г. Ремонт квартиры выполнен по проекту известного европейского архитектора. Квартира оборудована авторской антикварной мебелью и предметами интерьера. Квартира для ценителей европейского сдержанного дизайна, в доме с богатой историей. Великолепный вид из окон на ул. Ришельевская, Оперный театр и Пале Рояль- одно из самых любимых мест в мире! ', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-lanjeronovskaya-ulitsa-11791795.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-lanjeronovskaya-ulitsa__60575046fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-lanjeronovskaya-ulitsa__60575047fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-lanjeronovskaya-ulitsa__60575048fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-lanjeronovskaya-ulitsa__60575049fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-lanjeronovskaya-ulitsa__60575050fl.jpg"]', '2016-07-06 22:07:37'),
