(3543, 12690431, ' Не агентство.Продам квартиру с ремонтом, мебелью', '0630611111', 2663043, 'грн', 33288, 3, 80, 21, 25, 'Вторичный рынок', 'Одесса', 'Приморский', 'Генуэзская улица', 'Не агентство.Продам квартиру с ремонтом, мебелью и техникой в новом доме ЖК "Пальмира" расположенном в Аркадии, общей площадью 80кВ .м. Парадная полностью заселена.В парадной присутствует консьерж, бесшумные лифты OTIS.Двухэтажный подземный паркинг. Квартира находится на 21 этаже, с удобным подъездом к парадной, из вех окон панорамный вид на город . На благоустроенной придомовой территории находится детская площадка и парковка для автомобилей.также в доме двухэтажный подземный паркинг. Развитая инфраструктура, рядом с домом находится современный фитнес центр, супермаркеты, аптека,рестораны, салон красоты а так же детский развлекательный центр. В 5 минутах ходьбы от дома расположены лучшие пляжи Аркадии.', 'Состояние', 'монолитно-каркасный', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-genuezskaya-ulitsa-12690431.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-genuezskaya-ulitsa__69665339fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-genuezskaya-ulitsa__69665340fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-genuezskaya-ulitsa__69665341fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-genuezskaya-ulitsa__69665342fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-genuezskaya-ulitsa__69665344fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-genuezskaya-ulitsa__69665345fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odes