INSERT INTO `rooms` (`id`, `site_id`, `shortdistrict`, `phone`, `price`, `currency`, `price_m`, `count_rooms`, `square`, `floor`, `floors`, `type`, `district`, `street`, `street2`, `description`, `state`, `material`, `own_or_business`, `manager`, `coment`, `url`, `site`, `img`, `date`) VALUES
(3545, 12535351, ' Лучшая цена на 1-к квартиру в', '0487935017', 1873070, 'грн', 36020, 1, 52, 9, 19, 'Вторичный рынок', 'Одесса', 'Приморский', 'Большая Арнаутская улица, 23/1', 'Лучшая цена на 1-к квартиру в элитном ЖК "Башня CHKALOV", центр Одессы\nПродам просторную 1-комнатную квартиру в Жилом Комлпексе «Башня CHKALOV» элит-класса в самом центре Одессы. Квартира находится на 9-ом этаже, откуда открываются потрясающие виды на город и море. \n52,14/17,8/20,7\nСвободная планировка с возможностью объединения квартир. Пространство квартиры может быть организовано так: комната площадью 17,8 кв. м, просторная кухня-гостиная – 20,7 кв. м, ванная – 4,5 кв.м. \nБез комиссий и посредников! От надежного застройщика!\nСДАЧА – осень 2017г. Высокая степень готовности дома. Следующий Новый год Вы сможете встретить уже в своей новой элитной квартире!\nЭто единственный в городе проект с обустроенной зоной для отдыха и прогулок на 5-ом этаже, предусмотренной для круглогодичного использования жителями дома.\nОтличная локация в центре города, панорамное остекление, современные и удобные планировочные решения, роскошный вестибюль и воздушный атриум, декоративное водное пространство и собственная обустроенная зона для круглогодичного отдыха и прогулок на 5-ом этаже комплекса!\nХарактеристики квартиры: \nПотолки – 3,1 м.\nСтены – без штукатурки.\nОкна – панорамное остекление, фасадная оконная система с энергоэффективным стеклопакетом и алюминиевым профилем.\nВходная дверь в квартиру– металлическая.\nОтопление – собственная котельная, предусмотрен ввод отопительных труб в квартиру. \nСистема видеодомофона с выводом данных в квартиры и возможность подключения квартир к системе охранной сигнализации дома.\nХарактеристики ЖК «Башня CHKALOV»: \nИндивидуальная насосная станция и резервуар с суточным запасом воды. \nСистема видеонаблюдения, система контроля доступа мест общего пользования.\nТрехуровневый паркинг. \nПанорамные лифты.\nВестибюль с атмосферой роскоши и свободы.\nХолл атриума (декоративное водное пространство, высокие колонны и арки, искусственный водопад).\nПокупка квартиры в ЖК «Башня CHKALOV» сделает Вас хозяином лучших элитных квадратных местров в центре Одессы!', 'Состояние', 'газобетон', 'Не определено', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa-23-1-12535351.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa-23-1__67971538fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa-23-1__67971554fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa-23-1__67971570fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa-23-1__67971595fl.jpg"]', '2016-11-21 15:45:00'),
