(3550, 12535154, ' Акция! Продам 2-комнатную квартиру с большой', '0487935017', 2665054, 'грн', 36507, 2, 73, 10, 19, 'Вторичный рынок', 'Одесса', 'Приморский', 'Большая Арнаутская улица,23/1', 'Акция! Продам 2-комнатную квартиру с большой кухней-гостиной в элитном ЖК Башня CHKALOV, центр Одессы\nКвартира находится на 10-ом этаже, откуда открываются потрясающие виды на город и море. \n73,74/34,2/28,8\nСвободная планировка с возможностью объединения квартир. Пространство квартиры может быть организовано так: 2 комнаты площадью 18,3 кв. м и 15,9 кв. м, просторная кухня-гостиная –  28,8 кв. м, ванная – 6,5 кв.м. \nБез комиссий и посредников! От надежного застройщика!\nСДАЧА – осень 2017г. Высокая степень готовности дома. Следующий Новый год Вы сможете встретить уже в своей новой элитной квартире!\nЭто единственный в городе проект с обустроенной зоной для отдыха и прогулок на 5-ом этаже, предусмотренной для круглогодичного использования жителями дома.\nОтличная локация в центре города, панорамное остекление, современные и удобные планировочные решения, роскошный вестибюль и воздушный атриум, декоративное водное пространство и собственная обустроенная зона для круглогодичного отдыха и прогулок на 5-ом этаже комплекса!\nХарактеристики квартиры: \nПотолки – 3,1 м.\nСтены – без штукатурки.\nОкна – панорамное остекление, фасадная оконная система с энергоэффективным стеклопакетом и алюминиевым профилем.\nВходная дверь в квартиру– металлическая.\nОтопление – собственная котельная, предусмотрен ввод отопительных труб в квартиру. \nСистема видеодомофона с выводом данных в квартиры и возможность подключения квартир к системе охранной сигнализации дома.\nХарактеристики ЖК «Башня CHKALOV»: \nИндивидуальная насосная станция и резервуар с суточным запасом воды. \nСистема видеонаблюдения, система контроля доступа мест общего пользования.\nТрехуровневый паркинг. \nПанорамные лифты.\nВестибюль с атмосферой роскоши и свободы.\nХолл атриума (декоративное водное пространство, высокие колонны и арки, искусственный водопад).\nПокупка квартиры в ЖК «Башня CHKALOV» сделает Вас хозяином элитных квадратных метров в центре Одессы!', 'Состояние', 'газобетон', 'Не определено', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa23-1-12535154.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa23-1__67969247fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa23-1__67969268fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa23-1__67969298fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa23-1__67969305fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa23-1__67969311fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-bolshaya-arnautskaya-ulitsa23-1__67969314fl.jpg"]', '2016-11-21 15:23:14'),
