(3557, 12637227, ' Квартира в хорошем кирпичном (красный кирпич)', '0664500079', 1358696, 'грн', 19980, 3, 68, 2, 10, 'Вторичный рынок', 'Одесса', 'Малиновский', 'Улица не определена', 'Квартира в хорошем кирпичном (красный кирпич) доме внутри квартала, тихий зеленый двор с детской площадкой, чистый подъезд, состояние квартиры слабое жилое, бронированные двери(хорошие новые), на стенах обои, пол линолеум, санузел раздельный облицован плиткой 15х15, два балкона один застеклен второй нет, на окнах и на балконах есть кованные решетки, в самой квартире нет несущих стен и есть возможность шикарной перепланировки, на сегодняшний день люди делают косметический ремонт(видно на фото). Прекрасная транспортная развязка, рядом школа, детский сад, супермаркет и магазины (район Сильпо на ген.Петрова).', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-malinovskiy-12637227.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-malinovskiy__69014282fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-malinovskiy__69014284fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-malinovskiy__69014285fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-malinovskiy__69014286fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-malinovskiy__69014291fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-malinovskiy__69442962fl.jpg"]', '2016-12-07 17:33:19'),
