(3565, 12634167, ' Предлагается к продаже 2х комнатная квартира', '0487015080|0487015030', 1086956, 'грн', 24154, 2, 45, 2, 4, 'Вторичный рынок', 'Одесса', 'Приморский', 'Мясоедовская улица', 'Предлагается к продаже 2х комнатная квартира в центре города с капитальным ремонтом. Дом сталинской постройки. Квартира двухсторонняя, двухконтурный котел, встроенная кухня, мебель. Балкон застеклен, выходит на фасад и во двор. Срочная продажа!', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-myasoedovskaya-ulitsa-12634167.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-myasoedovskaya-ulitsa__68987861fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-myasoedovskaya-ulitsa__68987888fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-myasoedovskaya-ulitsa__68987897fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-myasoedovskaya-ulitsa__68987905fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-myasoedovskaya-ulitsa__68987911fl.jpg"]', '2016-12-07 11:56:28'),
(3566, 12634150, ' Станьте обладателем шикарной квартиры в новом', '0487047030|0487047020', 2445652, 'грн', 31354, 2, 78, 7, 17, 'Вторичный рынок', 'Одесса', 'Приморский', 'Белинского улица', 'Станьте обладателем шикарной квартиры в новом престижно доме! Приморский район! Совсем рядом море, трасса здоровья, парк Шевченко,  школы, дет. садики, магазины и т.д. Площадь 78 кв.м. Этаж 7/17. Потрясающий вид на город. Отличное месторасположение. Роскошный дом, который вписывается в архитектуру Одессы. Звоните!', 'Состояние', 'монолит', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-belinskogo-ulitsa-12634150.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-belinskogo-ulitsa__68987678fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-belinskogo-ulitsa__68987682fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-belinskogo-ulitsa__68987706fl.jpg"]', '2016-12-07 11:55:46'),
(3567, 12634116, ' Предлагается к продаже однокомнатная квартира с', '0487015080|0487015030', 1902174, 'грн', 41351, 1, 46, 19, 23, 'Вторичный рынок', 'Одесса', 'Приморский', 'Французский бульвар', 'Предлагается к продаже однокомнатная квартира с капитальным ремонтом студийного типа в новом современном элитном комплексе в Аркадии. Встроенная мебель/техника, панорамные окна, вид на море. Развитая инфраструктура, хорошая транспортная развязка. Спешите!', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar-12634116.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__68987296fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__68987300fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__68987305fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__68987318fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-frantsuzskiy-bulvar__68987323fl.jpg"]', '2016-12-07 11:51:07'),
(3568, 12634105, ' Продам 1 ком квартиру 39м,в новом', '0487047030|0487047020', 760869, 'грн', 20022, 1, 38, 12, 19, 'Вторичный рынок', 'Одесса', 'Приморский', 'Михайловская улица', 'Продам 1 ком квартиру 39м,в новом Жилом Комплексе комфорт-класса. Располагается на 12 этаже 19этажного дома. Окна выходят на зеленый Михайловский сквер, есть балкон. Внутри квартиры черновые работы выполнены ,на полу лазерная двухслойная стяжка готова под ваше покрытие, установлены МПО окна немецкого производителя .Заведены стояки горячей и холодной воды, есть все счетчики ,электричество ,интернет, На входе надежная бронированная дверь.\nКомплекс полностью автономный, установлена система »УМНЫЙ ДОМ».\nТерритория благоустроена ,под круглосуточной охраной. Оснащена детской спортивной площадками, зоной отдыха.\nКомплекс находится в 10 мин от центра города .\nХорошая транспортная развязка. Вблизи комплекса есть школа, дет.сад, крупный супермаркет.\nПокупайте ! Живите в безопасности и наслаждайтесь комфортом!\n', 'Состояние', 'монолит', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-mihaylovskaya-ulitsa-12634105.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-mihaylovskaya-ulitsa__68987201fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-mihaylovskaya-ulitsa__68987209fl.jpg"]', '2016-12-07 11:51:21'),
(3569, 12633838, ' Продается 2-комнатная квартира г.Одесса, ул. Люстдорфская', '0487998001|0487998002', 1168478, 'грн', 24343, 2, 48, 2, 9, 'Вторичный рынок', 'Одесса', 'Киевский', 'Люстдорфская дорога', 'Продается 2-комнатная квартира г.Одесса, ул. Люстдорфская дорога, площадью 48/28/8, комнаты раздельные, качественный капитальный ремонт, окна МПО, современная облицовка в кухне и в сан узле, (новая сантехника, новые трубы), приборы учета, электро бойлер, медная проводка, пол - плитка + ламинат, встроенная кухня + техника, шкаф-купе. Квартира очень теплая, солнечная. Дом расположен в 50 метрах от автобусной остановки, в 5 минутах ходьбы находятся школа и детский сад, рядом расположены магазины, супермаркеты.', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga-12633838.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984321fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984337fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984357fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984371fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984385fl.jpg"]', '2016-12-07 11:27:22'),
(3570, 12633819, ' Продается 1 комнатная квартира в г.', '0487998001|0487998002', 652174, 'грн', 21739, 1, 30, 2, 9, 'Вторичный рынок', 'Одесса', 'Киевский', 'Люстдорфская дорога', 'Продается 1 комнатная квартира в г. Одесса. 9-ти этажном пароходском доме. Общая площадь квартиры 30 м.кв. Отличное состояние. Внешняя столярка металлопластик. Встроенная кухня, бытовая техника. Санузел облицован, бойлер. Стены современные обои, пол плитка + ламинат. Квартира полностью укомплектована. Чистая парадная. Рядом школа, детский сад. Отличная транспортная развязка.', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga-12633819.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984001fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984011fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-lyustdorfskaya-doroga__68984021fl.jpg"]', '2016-12-07 11:25:34'),
(3571, 12632613, ' Продам двухкомнатную квартиру в новом доме', '0487090030|0487090040', 54348, 'грн', 905, 2, 60, 14, 24, 'Вторичный рынок', 'Одесса', 'Киевский', 'Академика Вильямса улица', 'Продам двухкомнатную квартиру в новом доме на Вильямса! Вид моря! Современный автономный комплекс. Паркинг. Своя школа с бассейном, детские сады, стадионы, супермаркеты, зоны отдыха, аллеи и скверы.\nОбщая площадь квартиры 60 кв.м. Кухня 16 кв.м, выход на лоджию 7 кв.м. Две спальни: 11 и 14 кв.м. Два санузла. Гардеробная.\nШикарный вид моря! Три лифта. Закрытая территория. Видеонаблюдение. Охрана.\nОформление 0%. Отдел продаж.\nПервый взнос - 2 тыс. Цена не увеличивается за кв.м.! Как при 100% расчете!\nАкция!!! Звоните!!!', 'Состояние', 'кирпич', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-kievskiy-akademika-vilyamsa-ulitsa-12632613.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-akademika-vilyamsa-ulitsa__68970585fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-akademika-vilyamsa-ulitsa__68970593fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-akademika-vilyamsa-ulitsa__68970596fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy-akademika-vilyamsa-ulitsa__68970601fl.jpg"]', '2016-12-07 09:47:57');
