(3576, 9187413, ' Живите с комфортом и для души!\nРекомендуем', '0487000334|0487000336', 1168478, 'грн', 25401, 1, 46, 10, 18, 'Вторичный рынок', 'Одесса', 'Киевский', 'Улица не определена', 'Живите с комфортом и для души!\nРекомендуем купить 1 комнатную квартиру в Киевском районе города Одессы. Квартира расположена в новом доме бизнес класса на 10 этаже 18 этажного дома. Общая площадь квартиры - 46 кв.м, комната – 19 кв.м, кухня – столовая – 12 кв.м. В квартире выполнен дорогой стильный ремонт с использованием качественных современных стройматериалов. Панорамное остекление окон с красивым видом на море и монастырь, натяжные потолки с подсветкой, полы – плитка с подогревом и паркетная доска. Санузел совмещен, облицован итальянской плиткой с декором, итальянская сантехника, джакузи. Внутренняя столярка – дерево. Стены с венецианской штукатуркой. Остается вся мебель, бытовая техника, занавеси, аксессуары. Есть гардеробная.\nДом с полной автономией, закрытая охраняемая территория, на территории детская площадка, паркинг. В доме фитнес-центр, магазин, планируется открытие зимнего сада. \n\nkiev1@premier.od.ua\n', 'Состояние', 'кирпич', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-kievskiy-9187413.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy__38192097fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy__38192098fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy__38192099fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy__38192100fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-kievskiy__38192101fl.jpg"]', '2014-11-02 20:44:22'),
