(3582, 12665111, ' Замечательная 1 комнатная квартира в новом', '0685758064|0482399504', 687500, 'грн', 15277, 1, 45, 5, 11, 'Вторичный рынок', 'Одесса', 'Суворовский', 'Паустовского улица', 'Замечательная 1 комнатная квартира в новом кирпичном доме - ЖК Янтарный.\nКомплекс расположился в Суворовском районе на улице Паустовского. Большая однокомнатная квартира с удобной и комфортной планировкой. Светлые помещения, автономная система отопления, металлопластиковые окна.\nДом на этапе сдачи. Ждем Вашего звонка!', 'Состояние', 'кирпич', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-suvorovskiy-paustovskogo-ulitsa-12665111.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-paustovskogo-ulitsa__69340247fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-paustovskogo-ulitsa__69340248fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-paustovskogo-ulitsa__69340273fl.jpg"]', '2016-12-13 11:52:17'),
(3583, 12486822, ' Жилой комплекс Соларис. \nДанный комплекс –', '0685758064|0482399504', 812500, 'грн', 13771, 2, 59, 10, 10, 'Вторичный рынок', 'Одесса', 'Суворовский', 'Академика Сахарова улица', 'Жилой комплекс Соларис. \nДанный комплекс – достоен выбора современных покупателей.\nЕсли вы мечтаете об уюте и комфорте, об удачном расположении вашего жилья и доступной цене\nна покупку, то данный жилой комплекс –\nединственно верное решение.', 'Состояние', 'газобетон', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-suvorovskiy-akademika-saharova-ulitsa-12486822.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-akademika-saharova-ulitsa__67573177fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-akademika-saharova-ulitsa__67573179fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-akademika-saharova-ulitsa__67573181fl.jpg"]', '2016-11-11 16:55:02'),
(3584, 11784382, ' Лучшая цена! В продаже просторная, 2-х', '0487002940', 1489538, 'грн', 21904, 2, 68, 10, 16, 'Вторичный рынок', 'Одесса', 'Приморский', 'Фонтанская Дорога', 'Лучшая цена! В продаже просторная, 2-х комнатная квартира, с очень интересной планировкой. Потрясающий вид на море. Два полноценных санузла, по 4.5 м2 (гостевой и хозяйский). Две гардеробные. Большая кухня, с выходом на широкую лоджию. Отличный,  жилой комплекс обустроен согласно всем современным нормам и технологиям. Лучший район города! Много зелени, близость моря, развитая инфраструктура и отличная транспортная развязка обеспечат Вам комфортную жизнь и крепкое здоровье. Звоните!! Без дополнительных расходов на оформление!!', 'Состояние', 'монолитно-блочный', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-fontanskaya-doroga-11784382.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-fontanskaya-doroga__60507443fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-fontanskaya-doroga__60507453fl.jpg"]', '2016-07-05 15:40:21'),
(3585, 11699193, ' Представляем вашему вниманию новый проект: уникальный', '0487881211', 660869, 'грн', 17391, 2, 38, 2, 5, 'Вторичный рынок', 'Одесса', 'Суворовский', 'ул. Г. Бочарова / Сахарова', 'Представляем вашему вниманию новый проект: уникальный современный жилой комплекс «Solaris». Заказчиком выступает ОП «Новый квартал».\r\nПод его руководством были построены всем известные ЖК «Суворовский» и «Суворовский-2», которые уже имеют положительную репутацию на рынке. В «SOLARIS» собрано все самое лучшее: это опыт наработанный с годами (качество строительства, своевременная сдача объектов, планировочные решения, приемлемые условия оплаты) и инновации.\r\nВ 10 эт. секциях есть цоколь, который подразумевает помещения направления бизнес. Также, на крыше планируются террасы.\r\nКонструктив дома:\r\n5 независимых свайных фундаментов;\r\n10- эт. секции- монолитно- каркасные с заполнением газобетона;\r\n5- эт. секции- красный кирпич;\r\nутепление фасада.\r\nЧто касается кровли, то она 2 типов:\r\nв 10- эт. кровля- еврорубероид;\r\nв 5- эт.- двухскатная металлочерепица с утеплением над мансардой;\r\nВысота помещений в чистом виде 2.75 м. В 10- эт. секциях лифты «Otis».\r\nОт однокомнатных апартаментов до 2- уровневых квартир. Правильные эргономичные планировки с возможностью трансформации удовлетворят запросы самых требовательных клиентов.', 'Перезвонить', 'кирпич', 'Бизнес', 'admin3', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-suvorovskiy-ul-g-bocharova---saharova-11699193.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-ul-g-bocharova---saharova__59649300fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-ul-g-bocharova---saharova__59649402fl.jpg"]', '2016-06-16 16:29:32'),
(3586, 12548751, ' Продам шикарную квартиру в ЖК Теплый', '0685758064|0482399504', 889946, 'грн', 12191, 2, 73, 2, 10, 'Вторичный рынок', 'Одесса', 'Суворовский', 'Днепропетровская дорога', 'Продам шикарную квартиру в ЖК Теплый дом.\nЖилой комплекс «Теплый дом» разместился в современном, перспективном, прогрессивно-развивающемся районе г. Одессы - поселке Котовского, который давно вышел за рамки просто спального района. Формально п.Котовского - микрорайон, расположенный в Суворовском районе Одессы, но по сути – «город в городе», являясь наибольшим по численности населения жилмассивом в Одессе, обладает своим неповторимым колоритом. ', 'Состояние', 'кирпич', 'Частного лица', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-suvorovskiy-dnepropetrovskaya-doroga-12548751.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-dnepropetrovskaya-doroga__68079258fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-dnepropetrovskaya-doroga__68079259fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-dnepropetrovskaya-doroga__68079260fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-suvorovskiy-dnepropetrovskaya-doroga__68079262fl.jpg"]', '2016-11-23 15:45:38'),
