(3591, 12580477, ' Однокомнатная квартира в новом жилом комплексе', '0487007888', 625000, 'грн', 15625, 1, 40, 1, 9, 'Новостройки', 'Одесса', 'Поселок Котовского', 'Днепропетровская дорога', 'Однокомнатная квартира в новом жилом комплексе ЖК «Золотая Эра». Малоэтажный автономный жилой комплекс домов со своей инфраструктурой. Дома газифицированы.Площадь квартиры 40 кв.м. , 1/9 эт. дома. Возможно перепланировать в 2-х комнатную. Установлены приборы учёта на свет, газ и воду. Качественное  остекление Rehau, бронированная входная дверь. Благоустроенная придомовая территория. Своя котельная. Близость морского побережья. Развитая инфраструктура, супермаркеты и развлекательные центры, удобная транспортная развязка.  Оформление входит в стоимость квартиры. ', 'Состояние', 'газобетон', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga-12580477.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__68388396fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__68388476fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__68388487fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__68388493fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__68388500fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__68388508fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-dnepropetrovskaya-doroga__68388521fl