(3592, 12580270, ' Двухкомнатная квартира площадью 63 кв.м, состояние', '0487007888', 883831, 'грн', 14029, 2, 63, 1, 9, 'Новостройки', 'Одесса', 'Поселок Котовского', 'Южная дорога', 'Двухкомнатная квартира площадью 63 кв.м, состояние – от строителей. Второй этаж девятиэтажного дома. Здание оборудовано бесшумными лифтами нового поколения. Жилой комплекс расположен в уютном и тихом районе Крыжановка, вблизи моря, красиво благоустроен, во дворе расположены детские и спортивные площадки, так же предусмотрена стоянка для автомобилей. Удобная транспортная развязка позволяет добраться до центра города за 20 минут, а близость торговых центров Ривьера и Метро является неоспоримым преимуществом.  Расчет по курсу НБУ. 0% оформление. Возможна поэтапная оплата.', 'Состояние', 'газобетон', 'Бизнес', '********', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga-12580270.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga__68385888fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga__68385889fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga__68385894fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga__68385900fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga__68385905fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga__68385907fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-poselok-kotovskogo-yujnaya-doroga__68385910fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja