(3593, 12318586, ' Продам 2-комнатную квартиру в центре и', '0673003267', 1182065, 'грн', 23177, 2, 51, 9, 9, 'Вторичный рынок', 'Одесса', 'Приморский', 'Екатерининская улица', 'Продам 2-комнатную квартиру в центре и исторической части города. \r\nИз окон квартиры открывается шикарный вид на море и город. \r\nРядом всё - это: привоз, железнодорожный вокзал, море, парк, школа, детский сад, магазины (какие хочешь), развлекательные современные заведения, театры, церковь, и т. д. шикарная транспортная развязка, как для людей с авто так и без, до Дерибасовской рукой подать, \r\nСостояние квартиры под евро ремонт. \r\nТорг уместен', 'Перезвонить', 'кирпич', 'Бизнес', 'admin', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-primorskiy-ekaterininskaya-ulitsa-12318586.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-ekaterininskaya-ulitsa__65818396fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-ekaterininskaya-ulitsa__65818403fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-ekaterininskaya-ulitsa__65818417fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-primorskiy-ekaterininskaya-ulitsa__69729212fl.jpg"]', '2016-10-16 11:15:45'),
(3594, 12688183, ' Шикарная Квартира по ул. Богдана Хмельницкого/Прохоровский', '0977910049', 1277174, 'грн', 22806, 2, 56, 1, 2, 'Вторичный рынок', 'Одесса', 'Молдаванка', 'Богдана Хмельницкого улица', 'Шикарная Квартира по ул. Богдана Хмельницкого/Прохоровский переулок. Двухкомнатная квартира с современным ремонтом со своим входом. Две раздельные комнаты 10+16. Санузел совмещен, есть кладовка, которую можно использовать как гардеробную. В кухне и санузле теплый пол Продается с мебелью и техникой. Двухконтурный котел . Коммуникации новые. Видеонаблюдение. Крепкий дом. В стоимость входит капитальный гараж, новой постройки 3х6 . Есть сухой подвал. Хорошая транспортная развязка. Рядом детский сад и школы.', 'Перезвонить', 'кирпич', 'Частного лица', 'admin2', '********', 'https://dom.ria.com/ru/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa-12688183.html', 'DomRia', '["https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa__69618097fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa__69618098fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa__69618100fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa__69618102fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa__69618104fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa__69618105fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kvartira-odessa-moldavanka-bogdana-hmelnitskogo-ulitsa__69618106fl.jpg","https:\\/\\/cdn.riastatic.com\\/photosnew\\/dom\\/photo\\/realty-prodaja-kva